INSERT INTO `kahanis` (`kahani_id`, `title`, `description`, `Duration`, `free`, `views`, `audio`, `video`, `image`, `pg`, `thumbnail`, `created_at`, `updated_at`) VALUES
(30, 'اکلوتا بچہ', 'آؤ بچو سنیں کہانی ۔ “اکلوتے بچے کی کہانی”\r\nایک دفعہ کا ذکر ہے ایک گاؤں میں ایک لڑکا رہتا تھا جس کا نام شیردل تھا۔ سب اسے پیار سے شیرو شیرو کہتے تھے۔ وہ اپنے امی ابو کا اکلوتا بچہ تھا، اس لئے اس کے امی ابو اس کا بہت خیال رکھتےتھے۔ لیکن شیرو اکیلا ہونے کی وجہ سے گھر میں بہت بور ہوتا تھا۔ جب وہ دیکھتا کہ اس کے اڑوس پڑوس کے بچے اپنے بہن بھائیوں کے ساتھ ہنسی خوشی کھیل رہے ہیں تو وہ سوچتا کہ کاش اس کی بھی کوئی ننھی منھی پیاری سی بہن ہوتی جسے وہ خوب کھلاتا اور کندھوں پر اٹھا کے بازار لے جاتا اوروہ اسے توتلی سی زبان میں سیلو بھیا سیلو بھیا کہہ کر پکارتی۔ اور اگر کاش ایک ساتھ کا بھائی بھی ہوتا تو وہ دونوں خوب کرکٹ کھیلتے اور مل کر شرارتیں کرتے۔ بس یہ سوچ سوچ کر اس کا دل اور بھی اداس ہو جاتا۔\r\nشیرو کے ابو گھر سے کچھ فاصلے پر ایک بہت بڑے جاگیردار کے ہاں ملازمت کرتے تھے اور اکثر شام ڈھلے گھر آتے۔ ابو کے آنے پر تو شیرو جیسے کھل ہی اٹھتا۔ دونوں ساتھ میں رات کا کھانا کھاتے اور دیر تک گپ شپ لگاتے رہتے۔ شیرو کے ابو اکثر اسے بتاتے کہ جہاں وہ کام کرتے ہیں وہ جاگیردار صاحب بہت اچھے انسان ہیں اور اپنے ہاں کام کرنے والوں کا بہت خیال رکھتے ہیں۔ اپنے ابو کی باتیں سن کر شیرو کا بہت دل چاہتا کہ وہ بھی کبھی جاگیردار صاحب سے ملے اور ان کی بڑی سی حویلی میں گھومے۔\r\n\r\nایک دن شیرو کے اسکول میں چھٹی تھی تو اس نے موقع دیکھ کر ابو سے فرمائش کر دی کہ اسے بھی اپنے ساتھ کام پر لے جائیں۔ لیکن ابو نے کہا کہ آپ کیا کرو گے وہاں جا کے، میں تو سارہ دن مصروف رہوں گا اور آپ بیٹھے بور ہوتے رہو گے۔ یہ سن کر شیرو اداس ہوگیا تو ابو نے کہا \"اچھا ایک شرط پر لے جا تا ہوں کہ تم وہاں کسی بھی چیز کو ہاتھ نہیں لگاؤ گے اور آرام سے ایک طرف بیٹھے رہو گے\"۔ شیرو خوش ہو گیا اور اس نے فورا\" حامی بھر لی۔ امی نے اسے صاف ستھرا جوڑا دیا اور وہ تیار ہو کر ابو کے ساتھ روانہ ہو گیا۔\r\nشیرو بہت خوش تھا اس کے دل میں لڈو پھوٹ رہے تھے کہ اس کے دل کی خواہش پوری ہونے جا رہی ہے۔ اتنی بڑی اور خوبصورت حویلی دیکھ کر شیرو حیران رہ گیا۔ حویلی کے اندر ایک بہت خوبصورت اور بہت بڑا سا لان تھا جس میں ایک طرف بچوں کے جھولے لگے تھے۔ شیرو کا دل چاہا کہ وہ لان کی نرم ملائم گھاس پر دوڑتا ہوا جھولوں پر چڑھ جاۓ، لیکن اسے ابو سے کیا ہوا وعدہ یاد آیا کہ وہ کسی چیز کو نہیں چھوئے گا۔ شیرو کے ابو اسے برآمدے میں ایک طرف بٹھا کر چلے گئے۔ ابھی کچھ ہی دیر گزری تھی کہ جاگیردار صاحب اس کے ابو کے ساتھ چلتے ہوۓ شیرو کے قریب آئے تو اس نے ادب سے انہیں سلا م کیا۔ انھوں نے نے رک کر سلام کا جواب دیا اور بڑے پیار پوچھا، \"ہاں بھئی شیردل صاحب کیسے ہیں آپ۔\" ان کی زبان سے اپنا نام سن کر شیرو کو بہت اچھا لگا اور وہ ‌ بولا \" جی میں ٹیھک ہوں\"پھر وہ بولے کہ \" تمہارے ابو نے بتایا کہ تم مجھ سے ملنا چاہتے تھے\"۔ شیرو نے بڑے اعتماد سے کہا \" جی ہاں، دراصل ابو آپ کی اتنی تعریف کرتے ہیں کہ میرا جی چاہا کہ میں آپ سے ملنے آؤں اور آپ کی یہ اتنی بڑی اور خوبصورت حویلی بھی دیکھ لوں۔\" اس کی پر اعتماد گفتگو سن کر جاگیردار صاحب بہت متاثر ہوۓ اوراس کے سر پر پیار سے ہاتھ پھیر کر بولے \" شاباش\" تو پھر یہاں کیوں بیٹھے ہو بھئی ،جاؤ گھومو پھرو اور پوری حویلی کی سیر کرو۔ اور ہاں وہ لان میں بڑے زبرست جھولے لگے ہیں بچوں کے، وہ لینا مت بھولنا۔ یہ کہہ کر وہ مسکراتے ہوۓ آگے بڑھ گئے اور ابو نے جلدی سے میرے کان میں کہا \" ہم باہر زمینوں پر جا رہے ہیں شام تک واپس آئیں گے۔ تم اپنا خیال رکھنا اور کوئی شرارت مت کرنا\"۔ یہ کہہ کر وہ فٹافٹ جاگیردار صاحب کی بڑی سی جیپ میں ان کے ساتھ بیٹھ کر چلے گئے۔\r\nشیرو کی تو جیسے دل کی مراد پوری ہو گئی۔ اسنے جھولوں کا رخ کیا اور دوڑتا ہوا وہاں پہنچ گیا۔ بڑی دیر اس نے جی بھر کے جھولے لئے۔ لیکن پھر وہ اداس ہو گیا اور سوچنے لگا کہ کاش وہ اکلوتا نہ ہوتا اور آج اس کے کوئی بہن بھائی وغیرہ ساتھ ہوتے تو کتنا مزہ آتا۔ اب اسے جھولے لینے کا بلکل مزہ نہیں آرہا تھا اور وہ کچھ تھک بھی گیا تھا اس لئے قریب ہی ایک درخت کی چھاؤں میں نرم نرم گھاس پر بیٹھ گیا۔ اسے نیند آگئی اور وہ وہیں گھاس پر لیٹ کے سو گيا۔\r\nکچھ دیر میں اس کی آنکھ کھلی تو ایک ملازمہ اسے جھنجوڑ رہی تھی، اور بول رہی تھی\" اٹھ یہاں کیوں لیٹا ہے، کون ہے تو اور کہاں سے آیا ہے\"۔ شیرو نے جب دیکھا کہ حویلی کی مالکن بھی وہاں موجود ہیں تو فٹ سے کھڑا ہو گیا اور بولا \"جی میں شیرو ہوں آپکے ملازم کرم دین کا بیٹا \"، اور جلدی سے اپنے آنے کی وجہ اور جاگیردار صاحب سے ملاقات کے بارے میں بتا دیا۔ مالکن نے تھوڑا سختی سے کہا \" لان کوئی سونے کی جگہ ہے، جاؤ برآمدے میں ایک طرف بیٹھ جاؤ\"۔ شیرو سہم گیا اور برآمدے میں آکر خاموشی سے بیٹھ گیا۔\r\nاتنے میں حویلی کا بڑا سا گیٹ کھلا اور ایک کار اندرداخل ہوئی۔ اس میں سے ایک لڑکا اور لڑکی نکلے، وہ دونوں اسکول یونیفارم میں تھے۔ گاڑی سے اترتے ہی اونچی آواز میں ایک دوسرے سے لڑنے لگے اور لڑتے لڑتے مالکن کے قریب پہنچ گئے۔ مالکن نے دونوں کو ڈانٹتے ہوۓ کہا \"نیلم؛ تیمور\" \"کیا مصیبت آ گئی ہے کیوں لڑ رہے ہو آپس میں \" لڑکی نے زور سے کہا \"دیکھیں نا امی تیمور نے میرا لنچ گرا دیا اور میں صبح سے بھوکی ہوں\"۔ امی نے سختی سے تیمور کے کان کھینچے اور کہا \"کیوں تیمور کیوں کیا تم نے ایسا\" تیمور اونچی آواز سے روتے ہو ۓ ضدی انداز میں بولا \"کروں گا کروں گا باربار کروں گا، آپ ہمیشہ اسی کا ساتھ دیتی ہیں، آپ مجھ سے پیار نہیں کرتیں، میں آپ سے خفا ہوں۔ یہ لیں اس کا لنچ باکس، کوئی نہیں گرایا میں نے، صرف شرارت میں چھپایا تھا۔\" یہ کہتے ہوۓ تیمور وہاں سے بھاگ کر اندر چلا گیا۔ ماں نے بیٹی کو ڈانٹا \" انسان دیکھ تو لیتا ہے، الزام لگانے سے پہلے\"۔ یہ سن کر نیلم بھی غصے سے اندر کی جانب دوڑ گئی۔ یہ سارا منظر دیکھ کر شیرو سوچنے لگا کہ میں ہر وقت اداس رہتا ہوں کہ میں اکیلا ہوں اور میرا کوئی بہن یا بھائی نہیں ہے۔ لیکن یہ دونوں کتنے ناشکرے ہیں \"بجاۓ اس کے کہ آپس میں مل جل کر خوش رہیں؛ یہ تو ایک دوسرے سے لڑ رہے ہیں\"۔\r\nدوپہر کے کھانے کے بعد شیرو کو مہمانوں کی بیٹھک میں بھیج دیا گیا، بیٹھک بہت ہی کشادہ تھی اور انتہائی خوبصورتی سے سجی ہوئی تھی۔ اس نے کچھ دیر وہاں آرام کیا اور شام کو پھر سے برآمدے میں آ کر بیٹھ گیا۔ اتنے میں شیرو کے ابو اور جاگیردار صاحب زمینوں سے واپس آگئے۔ جاگیردار صاحب نے مسکرا کر پوچھا \"ہاں شیرو بیٹا کیسا گذرا تمہارا دن، خوب مزے اڑائے\"۔ شیرو نے کہا \"جی بہت اچھا لگا آپ کی حویلی میں آکے۔\" انہیں شیرو کا پر اعتماد لہجہ بہت پسند آیا اوربولے \" شاباش شاباش \" چلو آؤ میں تمہیں تیمور اور نیلم سے ملواتا ہوں، وہ بھی تم سے مل کر بہت خوش ہونگے۔\" سامنے سے تیمور اور نیلم دوڑتے ہوۓ آئے اور جاگیردار صاحب سے چمٹ گئے۔ وہ بولے \" ہاں بھئ آج پھر جھگڑا ہوا ہے تم دونوں کا، تمہاری ماں نے مجھے فون پر سب بتا دیا\"۔ مالکن بھی وہیں موجود تھیں۔\r\nنیلم نے جاگیردار صاحب سے کہا \" بابا؛ میں بھائی اور امی سے ناراض ہوں\" تیمور فورا\" بولا \" ناراض ہو تو رہو مجھے کیا پرواہ\" اور دونوں پھر سے لڑنے لگے، نیلم نے تیمور کو پنجہ مارا اور جواب میں تیمور نے اس کے بال کھینچے۔ جاگیردار صاحب دونوں کے بیچ میں آگئے اور شیرو کی طرف دیکھ کر کہنے لگے \" یار تم بھی اپنے بہن بھائیوں کے ساتھ ایسے ہی لڑتے ہو\"۔ شیرو پھر سے پراعتماد لہجے میں بولا \" جاگیردار صاحب میں اپنے گھر میں اکلوتہ بچہ ہوں اور دن رات اس بات پہ اداس رہتا ہوں کہ کاش میرے بھی کوئی بھائی بہن ہوتے۔ لیکن نیلم اور تیمور کو دیکھ کر میں سوچ رہا ہوں کہ اگر بہن بھائی ایسے آپس میں ہر وقت جھگڑتے رہتے ہیں تو میں اکیلا ہی اچھا ہوں۔\" نیلم اور تیمور کے دل پر اسکی بات کا بہت گہرا اثر ہوا۔ دونوں کو اپنی غلطی کا شدید احساس ہوا اور فوراً ایک دوسرے سے معافی مانگ کر دوبارہ کبھی نہ لڑنے کا وعدہ کر لیا۔ یہ دیکھ کر جاگیردار صاحب اور مالکن بہت خوش ہوۓ۔ دونوں نے تیمور اور نیلم کے ساتھ شیرو کو بھی گلے لگا لیا۔ شیرو کے ابو جو خاموشی سے پاس کھڑے یہ سب دیکھ رہے تھے، اپنے بیٹے پر فخر محسوس کرنے لگے۔\r\nجاتے ہوۓ سب نے شیرو کو بہت سے تحفے دئیے اورجاگیردار صاحب نے اس کے ابو سے کہا کہ اب وہ ہر ہفتے شیرو کو حویلی لایا کریں، تاکہ وہ تیمور اور نیلم کے ساتھ مل کر کھیل سکے۔ شیرو خوشی خوشی اپنے ابو کے ساتھ گھر واپس آگیا اور سارا قصہ امی کو سنایا، امی اور ابو دونوں نے اسے گلے لگا کر خوب پیار کیا۔\r\nپیارے بچو! شیرو نے بھی وعدہ کر لیا کہ وہ آئندہ کبھی بھی اکلوتا بچہ ہونے پر اداس نہیں ہو گا اور ہمیشہ خوش رہے گا۔', '11m 32s', '0', '17', 'audio/3gQr4f91bxIhHqcfrSxkSyIlM4htDW2NIiVj6t8X.mp4', '', 'images/nyPk6NCbqzHmGEiK55aqpWJoEp0ZKAOePZDw4xGG.png', '7', 'thumbnails/kKD4aFVFtKWcCWwapYOYEPM1o8Swb3bB6GXWxOYa.png', '2024-08-27 07:14:53', '2024-10-17 17:38:53'),
(31, 'اندھیرا اور چراغ', 'آؤ بچو سنیں کہانی ۔ “اندھیرے اور چراغ کی کہانی”\r\n\r\nپرانے زمانے کی بات ہے جب بجلی نہیں ہوتی تھی ۔ سٹریٹ لائٹس بھی نہیں ہوتی تھیں اس لۓ رات کے وقت گلیوں میں گھپ اندھیرا چھا جاتا؛ اورسب لوگ اندھیرا ہونے سے پہلے ہی جلدی جلدی اپنا کام ختم کرکے اپنے گھروں  کوچلے جاتے۔ بجلی تو تھی نہیں اس لئے لوگ گھروں میں روشنی کے لئے تیل کے چراغ جلایا کرتے۔\r\n\r\nاسی زمانے میں ایک چھوٹے سے شہر میں ایک نابینا شخص رہتا تھا ۔ بچو نابینا اسے کہتے ہیں جو انکھوں سے دیکھ نہیں سکتا۔ یہ نابینا شخص اپنے سارے کام خود ہی کرتا تھا۔ وہ روز اپنے لئے پانی بھرنے کووئیں پر جا یا کرتا جہاں اور بھی لوگ پانی بھرنے آتے اور ایک لمبی لائن لگی ہوتی- نابینا شخص بھی اپنی باری کے انتظار میں کھڑا ہو جاتا، لیکن لوگ اس کا بہت خیال کرتے اور اسے لائن کے بغیر ہی فورا پانی بھردیتے۔ وہ بہت خودار انسان تھا اور نہیں چاہتا تھا کہ کوئی اس پر ترس کھاۓ۔ وہ لاکھ منع کرتا کہ اپنی باری پر ہی پانی بھرے گا، مگرلوگ اس کی ایک نہ سنتے۔ اور فورا\" اس کا گھڑا بھر دیتے۔ وہ بیچارہ شرمندہ شرمندہ سب کا شکریہ ادا کرتا اور اپنا گھڑا اٹھاۓ گھر واپس آجاتا۔\r\n\r\nایک دن اس نابینا شخص نے سوچا؛ کہ لوگ خواہ مہ خواہ مجھ پر ترس کھاتے ہیں؛ تو کیوں نہ میں دن کے بجاۓ رات کے وقت پانی بھر لایا کروں۔ سب لوگ تو اندھیرا ہوتے ہی گھروں کو چلے جاتے ہیں، مجھے اندھیرے کی کیا پرواہ۔ کیونکہ مجھے تو کچھ نظر ہی نہیں آتا۔ چاہے دن ہو یا رات میرے لئے تو ایک جیسے ہیں۔ بس اس خیال کا آنا تھا کہ اس دن وہ پانی بھرنے نہیں گیا اور رات کا انتظار کرنے لگا۔ جیسے ہی رات ہوئی اس نے سر پہ خالی گھڑا رکھا اور ہاتھ میں ایک روشن چراغ لئے کووئیں کی طرف چل پڑا۔\r\n\r\nبچو آپ سوچ رہے ہونگے ۔۔۔۔۔ \"جب اس نابینا شخص کو نظر ہی نہیں آتا تو اس نے ہاتھ میں روشن چراغ کیوں لیا۔ ہے نا مزے کی بات\" آئیں سنتے ہیں کہ پھر آگے کیا ہوا۔\r\n\r\nرستے میں کچھ شرارتی لڑکوں نے جو اس نابینا شخص کو جانتے تھے؛ جب سر پر گھڑا اٹھائے اور ہاتھ میں چراغ پکڑے دیکھا تو وہ بھی حیران ہو گئے۔ان میں سے ایک لڑکے کو شرارت سوجھی اور اسنے آگے بڑھ کرنابینا شخص سے مذاقا\" پوچھا ؛ ہاں بھئ  میاں صاحب رات کے اس وقت میں چراغ لئے کون سا خزانہ ڈھونڈنے جا رہے ہیں۔ لڑکے کے ساتھی اس کی بات پر ہنسنے لگے۔ دوسرے لڑکے نے بھی فورا\" کہا ارے یہ وہی چراغ لگتا ہے جو تمہاری امی کہتی ہیں کہ \"میرا بیٹا اتنا سوہنا ہے کہ چراغ لے کر بھی ڈنھونڈو گے تو نہیں ملے گا\"۔ سب لڑکوں نے زور دار قہقہ لگایا اور ہنس ہنس کر لوٹ پوٹ ہو گۓ۔ یہ سب شور سن کرکچھ اورلوگ بھی وہاں جمع ہوگئے۔\r\n\r\nنابینا شخص جو انتہائی اطمنان سے مسکراتے ہوئے ان کی یہ گفتگو سن رہا تھا بغیر برا مناۓ آگے بڑھنے لگا تو پھر سے پہلے والےلڑکے  نے مزاق اڑایا ۔۔۔۔ میاں صاحب چراغ کا راز تو بتاتے جائیں۔ کہیں یہ وہ چراغ تونہیں جس کو رگڑنے سے جن نکل آتا ہے اور کہتا ہے \"کیاحکم ہے میرے آقا\"۔ یہ سن کر پھر سے سب لڑکوں پر ہنسی کا دورہ پڑا اورسب پیٹ پکڑے ہنس ہنس کر ہلکان ہوگئے۔\r\n\r\n  اب وہ نابینا شخص بغیر کسی غصے کے بڑی خوش اخلاقی سے ان لڑکوں سے مخاطب ہوا اور کہنے لگا۔ بھائی میں تو آنکھوں سے اندھا ہوں، یہ چراغ میرے کس کام کا، یہ تو میں نے اس لۓ ساتھ رکھا ہے کہ رات کے اندھیرے میں کوئی عقل کا اندھا مجھ سے  ٹکرا نہ جاۓ اور میرا گھڑا نہ توڑ دے۔ ارد گرد کھڑے لوگ نابینا شخص کی ذہانت سے بہت متاثر ہوۓ اوران شرارتی لڑکوں کی کم عقلی پر ہنسنے لگے۔  وہ لڑکے جو نابینا شخص کو بیوقوف سمجھ کر اس کا مذاق اڑارے رہے تھے آخر کار خود ہی مذاق بن گۓ اور اپنی کم عقلی کی وجہ سے سب لوگوں کے سامنے شرم سے پانی پانی ہو گۓ۔\r\n\r\nبچو؛ اسی لۓ کہتے ہیں کہ کسی کی کمزوری کی وجہ سے اس کا مذاق نہیں اڑانا چاہئے۔', '5m 1s', '0', '26', 'audio/NpFj4yrPdz1VIdEKg78RQO8WJa3owNBxDvmel98j.mp3', '', 'images/QRZbMmzsQ4MpuFJMKBrSdTzfqY1JWpZb6fqlNyF2.png', '7', 'thumbnails/ej4kFbQKbW2aW8whACZcykyYNkNe6DsNoui8Sgee.png', '2024-08-27 07:19:52', '2024-10-17 14:14:27'),
(32, 'ایک بادشاہ اور یتیم لڑکی', 'آؤ بچو سنیں کہانی ۔ ” ایک بادشاہ اور یتیم لڑکی کی کہانی “\r\n\r\n\r\nایک دفعہ کا ذکر ہے ۔ ایک ملک کا بہت ہی رحم دل بادشاہ تھا ۔ وہ اپنی رعایا کا بہت خیال رکھتا تھا۔ اس کی رعایا بھی اس سے خوش تھی۔ لیکن وہ سب اس بات سے بہت پریشان تھے کہ بادشاہ کی کافی عمر ہو گئی ہے لیکن وہ شادی کرنے پر رضا مند نہیں ہوتا۔\r\n\r\nبادشاہ کی ایک بوڑھی ماں تھی، جسے وہ بہت چاہتا تھا اوراس کا بہت خیال رکھتا تھا، دراصل بادشاہ کو یہ ڈر تھا کہ اگر اس نے شادی کر لی تو کہیں اپنی زندگی میں مشغول ہو کربوڑھی ماں کو نہ بھول جاۓ۔ لیکن دوسرے لوگوں کی طرح اس کی ماں بھی چاہتی تھی کہ بادشاہ شادی کر کے اپنا گھر بسا لے۔ البتہ وہ اکثراپنے بیٹے سے کہتی کہ بادشاہ کی بیوی کو بہت سمجھدار، باوفا اور صبر کرنے والی ہونا چاہئیے۔ کیونکہ بادشاہوں کی زندگی دیکھنے میں تو بڑی پرکشش نظر آتی ہے مگر حقیقت میں کانٹوں کی سیج ہے۔ بڑی اونچ نیچ آتی ہے تو ایسے میں زندگی کی ساتھی ایسی ہونی چاہئے جو ہر مشکل میں اس کا ساتھ دے اور اگر خدا ناخواستہ بادشاہ کو کچھ ہو جائے تو وہ اس کے ملک اور رعایا کو اچھی طرح سنبھال سکے۔\r\nبس یوں ہی سال گزرتے گئے اور بادشاہ کی عمر بڑھتی رہی۔ آخر ایک دن بادشاہ کے سارے وزیر اور مشیر یک زبان ہو کربولے کہ آپکی رعایا آپ کے شادی نہ کرنے سے بہت پریشان ہے لہذا ہماری آپ سے التجا بے کہ اب\r\nآپ شادی کر ہی لیں۔ بادشاہ کے لاکھ منع کرنے پر وہ بضد رہے۔ اس نے جب لوگوں کا اصرار بڑھتے دیکھا تو آخر کار ان کی بات مان گیا۔ لیکن بادشاہ نے ایک شرط رکھی کہ جو بھی لڑکی اس کی ماں کے پاس محل میں پورا ایک دن گزار لے اور میری ماں اس راضی اور خوش رہے تو ایسی لڑکی سے میں شادی کر لوں گا۔ سب لوگ بہت خوش ہوۓ اورفوراً بادشاہ کی شرط کو قبول کر لیا۔\r\nدربار سے فارغ ہو کر بادشاہ اپنی ماں کے پاس آیا اور ساری بات بتا دی۔ اسکی شرط کے بارے سن کر بادشاہ کی ماں نے اپنے سب سے عقلمند اور وفادار مشیر سے مشورہ کیا؛ کہ کیسے وہ اپنے بیٹے کے لئے ایک بہترین لڑکی کو چنے۔ جو صرف عیش وعشرت کے لئے ملکہ نہ بنے بلکہ ایک مخلص اور وفادار بیوی بن کر زندگی بھراس کا ساتھ دے۔ یہ سن کر وہ مشیر کچھ دیر سوچتا رہا اور کافی غور کرنے کے بعد آخر کار اس کے ذہن میں ایک منصوبہ آہی گیا۔ بادشاہ کی ماں کو اس کا منصوبہ بہت پسند آیا اور وہ اس پر عمل کرنے کے لئے راضی ہو گئی۔\r\nاب کیا ہوا کہ سب امراء اور وزراء کی لڑکیاں باری باری محل میں آنے لگیں لیکن کوئی بھی وہاں ٹھرنہ پاتی اور روتی بسورتی اپنے گھربھاگ جاتی۔ یہ خبر ملک کے کونے کونے میں پھیل گئی اور دور دراز سے بھی لڑکیاں قسمت آزمآئی کے لئے آنے لگيں مگر کوئی بھی کامیاب نہ ہو سکی۔\r\nاسی ملک میں ایک یتیم لڑکی اپنی سوتیلی ماں کے پاس رہتی تھی۔ جو اس پر بہت ظلم کیا کرتی، چھوٹی چھوٹی بات پر اسے سزا دیتی اور کئی کئی دن اس کا کھانا بند کر دیتی۔ وہ لڑکی بہت صبر سے یہ سب برداشت کرتی۔ لیکن کبھی کبھی وہ اداس ہو جاتی اور سوچتی کہ آخر کیوں اسکی زندگی اتنی سختیوں سے بھری ہے۔\r\nایک دن جب اسے بادشاہ کے بارے معلوم ہوا تو اس نے سوچا کہ کیوں نہ وہ بھی محل میں قسمت آزمائے۔ وقت اور حالات کی سختیوں نے اسے کافی سمجھدار بنا دیا تھا۔ اس لئے اس نے سوچا کہ سب سے پہلے یہ جاننا ضروری ہے کہ ایسا کیا ہے کہ ہر لڑکی ناکام لوٹتی ہے۔ یہ معلوم کرنے وہ بھیس بدل کر محل کے باہر کھڑی ہو گئی اور جو بھی لڑکی محل سے نا کام باہر نکلتی وہ اس کی ہمدرد بن کر اس سے ساری معلومات لے لیتی۔ جلد ہی اسکو سمجھ آگئی کہ آخر اصل بات کیا ہے اور اس نے محل میں جانے کا فیصلہ کر لیا۔\r\nاگلے روز جب وہ محل میں داخل ہوئی تو بادشاہ کی ماں نے اسے بڑے زور دار لہجے میں ڈانٹا، \" آگئی ہو تم بھی ہمارا وقت ضائع کرنے، دفع ہو جاؤ یہاں سے، ہمیں تمہاری ضرورت نہیں ہے\" ۔ پہلے تو وہ لڑکی گھبرائی پھرآرام سے بولی \"یقیناً آپ صحیح فرما رہی ہیں ہم سب نے آپ کا بہت سا قیمتی وقت برباد کیا ہے، اب میری وجہ سے آپ کا موڈ خراب ہو گیا، اگر آپ اجازت دیں تو میں آپ کے لئے سوپ بنا لاؤں، اگر آپ کو پسند نہ آیا تو میں چلی جاؤں گی۔ یہ دیکھ کر بادشاہ کی ماں حیران رہ گئی۔ کیونکہ اس سے پہلے جو بھی لڑکیاں آئی تھیں وہ اس کی ڈانٹ سنتے ہی روتی ہوئی واپس دوڑ جاتی تھیں۔ لیکن یہ لڑکی اپنی جگہ پر جمی رہی اور ڈانٹ کا برا بھی نہیں منایا۔\r\nخیر کچھ ہی دیر میں اس لڑکی نے سوپ بنا کر انتہائی سلیقے سے پیش کیا۔ لیکن بادشاہ کی ماں نے ٹرے اٹھاکر پٹخنا چاہی۔ تو وہ لڑکی بولی \" میری ماں کہتی تھی ہمیں رزق کی عزت کرنی چاہئے کیونکہ یہ خدا کی طرف آتا ہے\" تو میری آپ سے گزارش ہے کہ بس ایک چمچ چکھ لیں اگر پسند نہ آۓ تو بیشک نہ پیجئیے گا۔ اسکی بات سے ماں بہت متاثر ہوئی اورجیسے ہی سوپ پیا تو وہ اتنا ذائقے دار تھا کہ وہ پورا پیالہ ہی مزے سے پی گئی اور لڑکی کو پاس بلا کر شاباش دی۔\r\nاس لڑکی نے موقع غنیمت جانا اور پاس بیٹھ کر ماں کے پاؤں دبانے لگی۔ اس کے ہاتھوں میں تو جیسے جادو تھا، ماں کچھ ہی دیر میں سو گئی۔ کافی دیر کے بعد جب آنکھ کھلی تو کیا دیکھتی ہے کہ وہ لڑکی بھی پاؤں دباتے دباتے وہیں سو گئی ۔ بادشاہ کی ماں کو لڑکی پر بہت پیار آیا اور اسے اٹھا کر گلے لگایا۔ پھر اس سے پوچھا کہ وہ کون ہے اور کہاں سے آئی ہے۔ لڑکی نے بتانا شروع کیا کہ کیسے اس کی سوتیلی ماں اس پر ظلم کرتی تھی، جس سے وہ سختیاں برداشت کرنے کی عادی بن گئی۔ اس نے بتایا کہ دراصل پہلے جو لڑکیاں یہاں آئی تھیں وہ سب ناز ونعم میں پلی تھیں انہیں زندگی کی سختیوں کا کوئی اندازہ ہی نہیں تھا اس لئے جب وہ آپ کی ڈانٹ سنتیں تو دلبرداشتہ ہو کر ہمت چھوڑ دیتیں۔ دراصل ان کے نزدیک بادشاہ سے شادی کرنا صرف ملکہ بننے اور نام و نمود کے لئے تھا۔\r\nاس لڑکی باتیں سن کر بادشاہ کی ماں بہت متاثر ہوئی اور بولی مجھے تمہاری جیسی لڑکی ہی کی تلاش تھی جو میرے بیٹے اور اس محل کو اچھی طرح سنبھال سکے۔ اور دھوم دھام سے بادشاہ کے ساتھ اسکی کی شادی کرادی۔\r\n\r\nشادی کے بعد بادشاہ نے بڑی حیرانی سے لڑکی سے پوچھا کہ آخرایسا کیا ہوا جو ماں نے تمہیں میری ملکہ بنانے کے لۓ چن لیا۔ لڑکی نے ساری بات تفصیل سی بتا دی اور رونے لگی۔ بادشاہ نے اسے سنبھالا اور پوچھا کہ کیوں رو رہی ہو، وہ بولی \" جب میری سوتیلی ماں مجھ پر ظلم کرتی تھی تو میں سوچتی تھی کہ آخر میری زندگی اتنی سخت کیوں ہے۔ آج مجھے سمجھ آئی کہ یہ سب سختیاں اس لئے تھیں کہ میں انہیں برداشت کرکے آپکی ملکہ بننے کے قابل بن سکوں\"۔ بادشاہ یہ سن کر بہت خوش ہوا اور اپنی ماں کے انتخاب پر مطمعن ہو گیا۔', '09m 00s', '0', '12', 'audio/aJ7EQMfTRl6EcKb8voWDLaYbccawMwYDEaYVeDHk.mp4', '', 'images/VP73w3r9ejaavpgYGtrsiZmOS133LQSGYPw8XMe4.png', '7', 'thumbnails/4hpEX11EOOPX3feXp7ZIQABdny0LpzgbCiPCpZoy.png', '2024-08-27 07:23:44', '2024-10-15 07:46:15'),
(33, 'چڑیا اور گھونسلا', 'آؤ بچو سنیں کہانی ۔ ” چڑیا اور گھونسلے کی کہانی”\r\n\r\nمنّے کے گھر کے باہر لوکاٹ کا ایک اونچا سا درخت لگا ہوا تھا ۔ منّا چونکہ گھر کی دوسری منزل پہ رہتا تھا اس لئیے لوکاٹ کے درخت کی شاخیں اس کے ٹیرس کے قریب سے ہوتی ہوئی چھت تک جا رہی تھیں۔ بہار کے موسم میں جب درخت پر پیلے پیلے لوکاٹ لگتے تو منّا بڑی آسانی سے مزے مزے کے لوکاٹ توڑ کر کھا لیتا۔ ایک دن وہ درخت پر پکے ہوۓ لوکاٹ ڈھونڈ رہا تھا کہ اس کی نظر ایک چڑیا پر پڑی۔ وہ بار بار اڑ کے کہیں جاتی اور واپسی پر اپنی چونچ میں گھاس کا باریک سا تیلا لے آتی۔ منے نے دیکھا کہ وہ چڑیا گھاس کے ان تیلوں کودرخت کی ٹہنیوں کے درمیان بڑی مہارت سے جوڑ رہی تھی۔ اتنے میں ایک چڑا بھی اس کا ہاتھ بٹانے آگیا۔ اور دونوں نے مل کر جلدی جلدی ایک نازک سا خوبصورت سا گھونسلہ بنا لیا۔ منّا بہت خوش ہوا اورایک برتن میں تھوڑا سا پانی لاکر ٹیرس کے کونے میں رکھ دیا۔ کچھ ہی دیر گزری تو منّے نے دیکھا کہ چڑا اورچڑی دونوں ہی وہاں سے پانی پی رہے ہیں۔ جیسے ہی وہ قریب آیا دونوں پھر سے اڑ گئے اور سیدھا اپنے گھونسلے میں چلے گئے۔\r\n\r\nکچھ دن بعد مّنے نے دیکھا کہ لوکاٹ کا ایک گچھا پک کربلکل تیار ہو گیا ہے۔ اس نے اپنا لمبا سا ڈنڈا اٹھایا تا کہ گچھا توڑ سکے، جیسے ہی اس نے ڈنڈا آگے کیا تو چڑیا جو اپنے گھونسلے میں پر پھلاۓ بیٹھی تھی ڈر کر اڑ گئی۔ اب منّے نے کیا دیکھا کہ چڑیا کے گھونسلے میں دو ننھے منھے، گول گول سفید رنگ کے انڈے پڑے ہیں۔ چڑیا دوبارہ درخت کے قریب آکر بیٹھ گئی اور اونچی آواز میں چوں چوں کرنے لگی۔ اتنے میں چڑا بھی آگیا اور دونوں نے شور مچا مچا کر آسمان سر پر اٹھا لیا۔ منّے نے جیسے ہی ڈنڈا پیچھے ہٹایا چڑی فورا\" اپنے گھونسلے میں گئی اور انڈوں کو اپنے سینے اورپروں کے نیچے سینچ لیا۔ اور چڑا بھی گھونسلے کے اردگرد چکر لگانے لگا، جیسے وہ ان کی حفاظت کر رہا ہو۔ منّا سمجھ گیا کہ یہ انڈے ان کے لۓ بہت قیمتی ہیں اس لئے اس نے جی چاہتے ہوۓ بھی لوکاٹ توڑنے کا ارادہ ترک کر دیا۔\r\nکچھ دن بعد منّے کو پھر سے چڑیا کے شور مچانے کی آواز آئی، وہ جلدی سے باہر نکلا تو اس نے دیکھا کہ ایک کوا؛ چڑیا کے گھونسلے کے قریب جانے کی کوشش کر رہا ہے اور دونوں چڑا اور چڑی نے ہنگامہ مچایا ہوا ہے۔ گھونسلے کے گرد دونوں شاخ پرکبھی ادھر اور کبھی ادھر بیٹھتے اور چیخ چیخ کر خود کو ہلکان کیا ہوا تھا ۔ منّے نے جیسے ہی ڈنڈا اٹھایا، کوا جھٹ سے اڑ گیا۔ اور سامنے والی چھت پر بیٹھا کائیں کائیں کرنے لگا۔ چڑیا آناً فاناً گھونسلے میں گئی اور انڈوں کو اپنے نیچے چھپا لیا۔ منّے نے زمین سے ایک کنکر اٹھا کر کوے کی جانب پھینکا تو کوا اڑ کر تھوڑا اور دور چلا گیا۔ چڑیا نے منّے کو ایسے دیکھا جیسے وہ اس کا شکریہ ادا کر رہی ہو۔منّا بہت خوش ہوا کہ؛ اس نے عین وقت پر چڑیا کی مدد کی اور اسے اپنے آپ پر فخر محسوس ہونے لگا۔\r\nلیکن وہ یہ سوچ کر پریشان ہو گیا کہ ابھی تو میں یہا ں موجود تھا لیکن ایسا نہ ہو کہ جب میں اسکول جاؤں یا گھر سے کہیں باہر جاؤں، تو پھر سے یہ کوا حملہ نہ کر دے۔ یہ سوچتے ہوۓ منّے کے ذہن میں ایک خیال آیا اور اس نے اپنے لوکاٹ توڑنے والے ڈنڈے کے اوپر امّی سے ایک باریک سا کپڑا بندھوا لیا، اور ڈنڈے کو کھڑا کر کے ٹیرس کی ریلنگ کے ساتھ باندھ دیا۔ منّے کا یہ ہربہ کامیاب رہا کیونکہ ڈنڈے کے اوپر کپڑا ایک جھنڈے کی طرح ہر وقت ہوا سے ہلتا رہتا اور کوا کائیں کائیں کرتا ادھر ادھر بیٹھتا مگر ڈنڈے کے خوف سے درخت کے قریب نہ آتا۔\r\nایسے ہی کئی دن گزر گئے اور ایک دن منّے کو محسوس ہوا کہ جیسے گھونسلے میں سے بہت ہی باریک سی چوں چوں کی آواز آ رہی ہے۔ اب جو اس نے غور سے دیکھا تو اسے گھونسلے میں دو ننھے ننھے سے چڑیا کے بچے دکھائی دیئے۔ چڑا اور چڑی باری باری اڑ کر جاتے اور اپنے منہ میں دانہ لاتے اور بچوں کو کھلا دیتے۔ دونوں کو کہیں دور سے دانہ لانا پڑتا اس لۓ بچے شور مچاتے رہتے جیسے انہیں بہت بھوک لگ رہی ہو۔ منّے نے پانی کے ساتھ مٹی کے ایک برتن میں دانہ بھی ڈال دیا۔ چڑیا پہلے تو کچھ جھچکی لیکن آہستہ آہستہ وہاں سے دانہ چگنا شروع کردیا۔ اور بڑی آسانی سے بچوں کو کھلانے لگی۔ چند ہی دنوں میں ان لاغر اور کمزور بچوں نے خوب جان پکڑ لی اور اب وہ خود ہی دانہ چگنے آنے لگے۔ دور بیٹھا کوا حسرت بھری نظروں سے انہیں دیکھتا رہتا۔ آخر کار وہ مایوس ہو کر وہاں سے ہمیشہ ہمیشہ کے لئے چلا گیا۔ اور ساری چڑیاں خوشی خوشی ساتھ میں رہنے لگیں۔\r\nدیکھا بچو؛ منّے نے کیسے چڑیوں کو کوے سے بچایا، آپ کے گھر بھی آگر کوئی چڑیا آۓ تو اس کا خیال رکھنا۔', '05m 43s', '0', '7', 'audio/zRujtfXZQ5ok5TFqoe8L6ffeE3v7C9z4ehb9Plm6.mp3', '', 'images/jKRDY8zz9EZf5dNfGaycBhid1SJnHin7UA18ZyqB.png', '3', 'thumbnai