(34, 'بھیڑیا اور چالاک بکری', 'ایک چرواہا روز اپنی بکریوں کو چرانے لے جاتا دن بھر گھومنے کے باوجود اس کی بکریوں کا پیٹ نہ بھرتا ۔ کیونکہ اس گھر کے قریب کی ساری گھاس بکریاں اوردوسرے جانور پہلے ہی کھا چکے تھے۔ اس کے گھر سے کچھ فاصلے پرایک نہر تھی جہاں وہ روز اپنی بکریوں کو پانی پلانے لے جاتا۔ نہرکے پار ایک گھنا جنگل تھا جوکہ بہت ہی ہرا بھرا تھا اوربکریوں کے چرنے کے لۓ وہاں بہت ہی زبردست اوررسیلی گھاس بھی تھی۔ بکریوں کا اس گھاس کو دیکھ کربہت جی للچاتا اور وہ سوچتیں؛ کاش ہم وہ رس بھری لمبی لمبی گھاس کھاکراپنا پیٹ بھرسکیں۔  لیکن وہ نہر کے پار اس لئے نہیں جا سکتی تھیں کیونکہ وہاں گھنے جنگل میں ایک بہت ہی خونخواربھیڑیا رہتا تھا اوراکثر رات کواس کی خوفناک آواز آیا کرتی ؛ ڈر کے مارے بکریوں کی تو جان ہی نکل جاتی۔\r\n\r\nان میں سے ایک بکری بہت عقلمند تھی اور اکثر دوسری بکریوں سے کہتی کہ اس بھیڑۓ کی آواز سے ہی تمہارا دم نکل جاتا ہے اگر کسی دن وہ سامنے آگیا تو کیا کرو گی۔ یہ سوچ کر سب بکریاں اور بھی سہم جاتیں۔\r\n\r\nایک دن اس عقلمند بکری کو بہت زیادہ بھوک لگی ہوئی تھی اور نہر کے پار اسے مزے مزے کی گھاس بھی نظر آرہی تھی اس نے سوچا کہ ابھی تو دن کا وقت ہے بھیڑیا تو رات کو آتا ہے تو کیوں نہ چپکے سے نہر کے پار ہو جاؤں اور جلدی جلدی پیٹ بھر کر واپس آجاوں۔ بکری نے آہستہ آہستہ اپنے آپ کوگلے سے الگ کیا اور چرواہے سے نظربچا کرنہر میں اتر گئی۔ ٹھنڈے ٹھنڈے پانی سے اسےگدگدی سی ہونے لگی لیکن اس نے خاموشی سے برداشت کیا اورآہستہ سے تیرتی ہوئی نہر کے پار پہنچ گئی۔ اتنی ساری مزے مزے کی لمبی اور رسیلی گھاس میں آکر اس کی تو خوشی کی انتہاہ نہیں تھی۔ بھوک بھی بہت شدید لگ رہی تھی اس نے آؤ دیکھا نہ تاؤ بس پل پڑی اور گھاس چرنے میں مشغول ہو گئی۔\r\n\r\nآج تو اس کا جی ہی نہیں بھر رہا تھا اچھی سے اچھی گھاس کی لالچ میں وہ بہت دور نکل آئی اوراتنی گھاس کھائی کہ اب اس سے چلا ہی نہیں جا رہا تھا۔اس نے سوچا ابھی تو شام ہونے میں کچھ وقت باقی ہے چلو تھوڑی دیرسستا لیتے ہیں پھر واپس چلے جائیں گے۔ اب جوبکری سوئی تو بہت دیر تک سوتی رہی۔ اچانک اس کی آنکھ کھلی تو ہرطرف اندھیرا ہی اندھیرا پھیلا ہوا تھا۔ وہ تھوڑی پریشان ہوئی کہ اب میں گھر واپس کیسے جاؤں گی۔ اس نے بہت کوشش کی کہ واپسی کا راستہ تلاش کر لے مگر وہ مزید بھٹک گئی۔ آخر کار اس نے فیصلہ کیا کہ چلو رات کسی نہ کسی طرح چھپ کر گزار لیتی ہوں صبح سویرے راستہ تلاش کر واپس گھر چلی جاؤں گی۔\r\n\r\nقریب ہی اسے ایک غار نظر آئی اور وہ بے ڈھڑک غار میں چلی گئی۔ غار اندر سے خالی تھی اور وہ بڑے آرام سے بیٹھ گئي۔ اتنے میں اسے دور کہیں سے بھیڑۓ کی خوفناک آواز آئی۔ اسے یاد آیا کہ میں تو اسی جنگل میں ہوں جہاں یہ خونخواربھیڑیا رہتا ہے جس کی آواز سن کر ہی سب کی جان نکل جاتی تھی۔ اس نے خود سے کہا وہاں تو تم بڑی بڑی باتیں بناتی تھیں سوچو اگر آج واقعی وہ تمہارے سامنے آگیا تو کیا کروگی۔ اس خیال نے اس جسم میں خوف کی لہرسی دوڑا دی۔\r\n\r\nبھیڑۓ کی آواز جو پہلے دور سے آرہی تھی آہستہ آہستہ قریب آنے لگی اور پھر وہ اتنے قریب آگئی جیسے وہ بلکل غار کے باہر سے آرہی ہو۔ بکری بلکل خاموشی سے دبک کر غارکے ایک کونے میں بیٹھ گئی۔ اتنے میں بھیڑیا غار کے اندر ہی آگیا اسنے جو بکری کودیکھا توخوفناک سی ہنسی ہنس کر بولا۔ واہ رے میرے ربا میں سارے جنگل میں شکار کے لۓ خوار ہو رہا ہوں اور تو نے اتنی موٹی تازی بکری میری غار میں ہی بھیج دی ہے۔ بکری نے اپنے آپ کو کوسا کہ تجھے بھی چھپنے کے لئے یہی جگہ ملی تھی خود ہی چل کر اس خوفناک بھیڑۓ کی غار آگئی۔\r\n\r\nبھیڑۓ کی سرخ سرخ خونخوارآنکھیں، تیز نوکیلے دانت اور منہ سے لٹکتی تیز دھاری زبان دیکھ کر بکری کا تو دم ہی نکل گیا۔ پھر بکری نے تھوڑی ہمت کی اور سوچا کہ جان بچانے کا کوئی تو حیلہ کیا جائے۔\r\n\r\nجیسے ہی بھیڑیا اس کی طرف بڑھا تو بکری نے آواز کو تھوڑا بھاری کیا اور اپنے سینگوں کو سیدھا کر کے بولی۔ چلو اچھا ہوا تم خود ہی یہاں آگئے۔ آج میں نے دس چیتے اور پانچ شیر شکار کۓ ہیں۔ لیکن کوئی بھی بھیڑیا نہیں ملا کہ میں اسے کھا سکوں۔ بھیڑیا وہیں رک گیا اور سوچنے لگا کہیں یہ بکری سچ ہی نہ بول رہی ہو۔ بکری نے موقع دیکھا اور گرجدار آوازمیں بولی تم بھاگنے کا سوچنا بھی مت۔ اب بھیڑیا جو گھبرا کے کچھ پیچھے کو ہٹ رہا تھا دبک کروہیں بیٹھ گیا۔اور گڑگڑا کردرخواست کرنے لگا میں بہت گندہ ہوں اگر آپ اجازت دیں تو میں نہر میں نہا کر آجاؤں پھر آپ مجھے شوق سے کھالینا۔ بکری نے کہا اچھا جاؤ مگر یاد رکھنا مجھے دھوکہ دے کر بھاگنے والا کبھی بچتا نہیں۔ بھیڑۓ کو جیسے ہی اجازت ملی وہ سر پر پیر رکھ کر دوڑگیا۔ بکری نے سکون کا سانس اور جان بچنے پر اللہ کا شکر ادا کیا۔\r\n\r\nسرپٹ دوڑتے ہوۓ بھیڑے کو رستے میں ایک گیدڑملا ۔اس نے پوچھا اتنی تیزی سے کہاں بھاگے جا رہے ہو۔  بھیڑۓ نے جلدی جلدی گیدڑکو ساری بات بتا دی۔ گیدڑ سمجھ گیا کہ بکری نے اسے بیوقوف بنایا ہے۔ گیدڑہنسا۔۔۔ آؤ بھئ بھیڑۓ آج تو تمہاری طرف سے دعوت ہوگئی، دونوں مل کر اڑائیں گے۔ارے بکری بھی کبھی شیر چیتوں کا شکار کر سکتی ہے یہ کہہ کر گیدڑ اسے ساتھ واپس لے آیا۔ اب جو بکری نے دونوں کو ساتھ آتے دیکھا۔ تو اونچی آواز میں بولی۔ ارے اوگیدڑ تو نے بہت اچھا کام کیا کہ میرے مجرم کو پکڑ لایا۔ اب میں تجھے منہ مانگا انعام دوںگی۔ گیدڑ یہ سن کرہکہ بکہ رہ گیا۔ جبکہ بھیڑیا جوپہلے ہی ڈرا ہوا تھا، یہ سمجھا کہ گیدڑ بھی بکری کے ساتھ ملا ہوا ہے اور اسے بہلا پھسلا کر دوبارہ واپس لے آیا ہے۔ بس اس نے فورا گیدڑپر حملہ کرکے اسے مار دیا اورپہلے سے دوگنی رفتار میں وہاں سے دوڑگیا۔اور دوبارہ مڑ کر کبھی واپس نہیں آیا۔\r\n\r\nاگلے دن صبح صبح بکری واپس اپنے گھر پہنچی اورگلے میں سب کو گزری شب کا احوال سنایا تو سب بہت خوش ہوۓ اور اس کی حاضر دماغی کی بہت تعریف کی۔ کیونکہ اب وہ سب بے خوف ہو کر نہر کر پار کی گھاس سے اپنا پیٹ بھر سکتے تھے۔\r\n\r\nدیکھا بچو، ہمت و حوصلہ رکھنے اور حاضر دماغی سے بڑی سےبڑی مشکل حل ہوجاتی ہے۔', '07m 34s', '1', '356', 'audio/8u6WnhSRrPPt4XUltS6KudxgurTLgioXiDWQtqKP.mp3', '', 'images/6GTF3zR9YKFsQAJBcoIIcS9NVdi1c8xawWCjGMo4.png', '3', 'thumbnails/mMktnIkDaUwBveeATAn1TpLI6b69MPRY7us6ekgr.png', '2024-08-27 07:28:17', '2024-10-17 17:36:10'),
(35, 'دو بیل ایک شیر', 'آؤ بچو سنیں کہانی ۔ ” دو بیل اور ایک شیر کی کہانی “\r\n\r\nایک جنگل میں دو بہت ہی خوبصورت اور طاقتور بیل رہتے تھے، ایک کا رنگ سفید تھا اور دوسرا بھورے رنگ کا تھا۔ دونوں کی آپس میں بہت گہری دوستی تھی اور وہ ہر وقت ساتھ رہتے تھے۔\r\nجنگل کے بڑے بڑے طاقتورجانور جیسے ہاتھی، گینڈا، جنگلی بھینسا اور یہاں تک کہ جنگل کا بادشاہ شیربھی ان سے ڈرتا تھا۔ شیر کا ان بیلوں کو دیکھ کر بہت جی للچاتا اور ان کا موٹا تازہ اور لذیذ گوشت سے بھرا جسم دیکھ کر اس کے منہ میں پانی بھر آتا۔ لیکن وہ جب بھی ان بیلوں پر حملہ کرتا تو دونوں مل کراس کا مقابلہ کرتے اور اس کی خوب درگت بناتے۔ ہر دفعہ شیر کو جان بچا کر بھاگنا ہی پڑتا۔ شیر کو ان پر بہت غصہ تھا اور وہ ہر وقت یہ سوچتا رہتا کہ کاش میں کبھی ان کا شکار کر کے کھا سکوں۔\r\n\r\nایک دن وہ جھاڑیوں کے پیچھے سے چھپ کر ان دونوں بیلوں کو للچائی ہوئی نظروں سے دیکھ رہا تھا کہ وہاں سے ایک چالاک لومڑی گزری۔ اس نے جو شیر کو ایسے بیلوں کو گھورتے دیکھا، تو شیر کے پاس گئی اور بڑے ادب سے بولی \"بادشاہ سلامت آپ کیا دیکھ رہے ہیں\"۔ شیر نے اپنے دل کی بات لومڑی کو بتا دی کہ وہ ان دونوں بیلوں کا شکار کرنا چاہتا ہے مگر ان دونوں کی پکی دوستی اور آپس میں اتفاق کی وجہ سے انہیں قابو نہیں کر پاتا۔ شیر مزید بولا \"کہ ان بیلوں کو دیکھ کردوسرے جانوروں نے بھی آپس میں اتحاد شروع کر دیا ہے، اس طرح تو آہستہ آہستہ میری بادشاہت ختم ہو جاۓ گی اور میں بھوکا مر جاؤں گا\"۔\r\nشیر کی باتیں سن کرمکارلومڑی کے ذہن میں ایک خیال آیا اور اسنے سوچا، کیوں نہ اس موقع سے فائدہ اٹھایا جاۓ۔ اس نے شیر کی خوشامد کی اور بولی \" بادشاہ سلامت کا اقبال بلند ہو، اگر اجازت ہو تو یہ ناچیز کچھ عرض کرے\"۔ لومڑی کی خوشامد سن کر شیرمغرور انداز میں بولا۔ \" ہاں اجازت ہے\" ۔\r\nپھر چالاک لومڑی بولی \" آپ کے اس مسئلے کا حل تو میرے بائیں ہاتھ کا کھیل ہے بس چند دن مجھے دے دیں پھر یہ بیل ایک ایک کر کے خود ہی شکار ہونے کے لئے تیار ہونگے\"۔ شیر یہ سن کر بہت خوش ہوا۔ لومڑی بولی لیکن میری کچھ شرطیں ہیں، \"جیسے ہی آپ بیلوں کو شکار کر لیں گے تو سارے جنگل کے سامنے مجھے اپنا وزیر بنا لیں گے اور نہ صرف دوسرے درندوں سے میری حفاظت کریں گے بلکہ جو کچھ بھی آپ شکار کریں گے اس میں میرا بھی حصہ ہو گا\"۔ شیر نے للچائی ہوئی نظروں سے بیلوں کی طرف دیکھا اور چالاک لومڑی کی تمام شرطیں مان گیا۔\r\nاگلے روز چالاک لومڑی سفید بیل کے پاس گئی اور اس کی بہت خوشامد کرنے لگی۔ \" تم تو بہت خوبصورت ہوتمہارا یہ گورا سفید رنگ بہت بھلا لگتا ہے، اور تمہاری طاقت اور بہادری کے قصے بچے بچے کی زبان پر ہیں کہ کیسے تم نے شیر جیسے طاقتور جانور کو کئی بار شکست دی ہے۔ ویسے سچ بتاؤں وہ بھورا بیل صرف تمہاری وجہ سے زندہ ہے ورنہ شیر کب کا اسے ہڑپ کر چکا ہوتا۔ شائید اسی لئے وہ ہر وقت تمہارے پیچھے پیچھے پھرتا ہے\"۔ اپنی اتنی زیادہ تعریف اور خوشامد سن کر سفید بیل غرور میں آگیا اور خود کو برتر جبکہ بھورے بیل کو کمزور اور حقیر سمجھنے لگا۔\r\nکچھ دن بعد موقع پا کر لومڑی نے یہی سب کچھ بھورے بیل سے بھی کہا اور اسے بتایا کہ وہ سفید بیل سے زیادہ طاقتور اور بہادر ہے۔ بھورا بیل سمجھدار تھا وہ لومڑی کی چکنی چپڑی باتوں میں نہ آیا اور بولا۔ \" خیر تو ہے بی لومڑی کس مشن پہ ہو، کہیں ہم دونوں دوستوں کے درمیان جھگڑا کرانے کا ارادہ تو نہیں\"۔ لومڑی کا وار خالی گیا تو وہ کھسیانی ہنسی ہنس کر بولی \" میں تو بس سچ بول رہی تھی، باقی تم جو مرضی سمجھو\"۔\r\nبھورے بیل نے ان سب باتوں کا کوئی اثر نہیں لیا مگر سفید بیل لومڑی کی باتوں میں آگیا اور مغرور ہو گیا۔ اب وہ بھورے بیل سے کچھ کھچا کھچا رہنے لگا۔ ایک دن وہ اکیلا جا رہا تھا کہ بھورا بیل بھی دوڑتا ہوا اس کے پیچھے آگیا۔ اس نے بھورے بیل کو ڈانٹ دیا \" تم کیا ہر وقت میری دم بنے پھرتے ہو، کبھی جان چھوڑ بھی دیا کرو\" بھورا بیل حیران پریشان دیکھ رہا تھا کہ وہ پھر سے زوردار آواز میں بولا،\" بزدل کہیں کے اتنا مت ڈرو، نہیں کھاتا شیر تمہیں، جاؤ یہاں سے میں کچھ دیر اکیلا رہنا چاہتا ہوں\"۔ یہ سب باتیں سن کر بھورے بیل کو بہت دکھ ہوا۔اور وہ وہاں چلا گیا۔ اور سفید بیل اکیلا رہ گیا۔\r\nچالاک لومڑی نے یہ سب منظر دیکھا تو جلدی سے شیر کے پاس آئی اور بولی \"بادشاہ سلامت آپ کا پہلا شکار تیار ہے\" ۔ شیر اندر ہی اندر بہت خوش ہوا لیکن رعب دار آواز میں بولا \" اگر یہ سچ ہے تو جلد ہی ہم تمہیں اپنا وزیر بنا لیں گے، لیکن اگر کوئی گڑبڑ ہوئی تو تمہاری خیر نہیں۔ لومڑی اعتماد سے بولی \" جائیے حضور! شکار آپ کے انتظار میں ہے\"۔\r\nشیر نکلا اور اس نے جھاڑیوں کے پیچھے سے دیکھا کہ واقعی سفید بیل اکیلا ہی گھاس چر رہا ہے اور بھورے بیل کا کہیں نام ونشان نہیں۔ بس پھر کیا تھا اس نے فوراً سفید بیل پر حملہ کردیا اور اپنا طاقتور پنجہ زور دار طریقے سے اس کی پیٹھ پر مارا۔ وہ اس اچانک حملے کے لئے تیار نہ تھا اور شیر کا طاقتور پنجہ لگنے سے اسے اتنی شدید تکلیف ہوئی جیسے اس کی کمر ہی ٹوٹ گئی ہو۔ اس سے پہلے کہ سفید بیل سنبھلتا شیر نے اس کی گردن کو دبوچ لیا۔ بیل نے خود کو چھڑانے کے لئے بڑا زور لگایا اور موقع پاتے ہی ایک زور دار دولتی شیر کے پیٹ میں ماردی، شیر درد سے بلبلا اٹھا مگر اس نے اپنی گرفت کو کمزور نہ ہونے دیا اور جلد ہی بیل کمزورپڑ گیا اور شیر اس پر حاوی آگیا۔\r\nبس اب شیر سفید بیل کو زمین پر پٹخنے ہی والا تھا کہ کسی نے اس کی پیٹھ پر زور دار ٹکرمار دی ۔ اس نے مڑ کر جو دیکھا تو بھورا بیل انتہائی غصّے کی حالت میں اس کے پیچھے کھڑا تھا۔ اس سے پہلے کہ شیر اس پر حملہ کرتا، بھورے بیل نے اپنے مضبوط سینگوں کے پورے زور سے اسے ایک اور ٹکر رسید کی۔ شیر کی تو جیسے جان ہی نکل گئی۔ لیکن جلد ہی اس نے خود کو سنبھالا اور بھورے بیل پر حملے کے لئے مڑا۔ سفید بیل نے جو دیکھا کہ بھورے بیل نے اس کی جان بچائی ہے اور اب اس کی اپنی زندگی کو خطرہ ہے۔ تو وہ اپنے زخموں کی پرواہ کئے بغیر اٹھا اور شیر کے پیٹ میں اپنے سینگ گاڑھ دئیے۔ شیر درد سے کراہا اور دونوں بیلوں کو ساتھ کھڑا دیکھا کر وہاں سے بھاگ گیا۔\r\nادھرلومڑی جو شیر کے گھر میں بیٹھی وزیر بننے کے خواب دیکھ رہی تھی، اچانک شیر کو زخمی حالت میں آتا دیکھ کرخوفزدہ ہوگئی۔ شیر غصّے سے ڈھاڑا۔ \"مکار لومڑی تو نے میرے ساتھ دھوکا کیا ہے، میں تجھے نہیں چھوڑوں گا\"۔ لومڑی نے ہزار خوشامد کی لیکن شیر نے اسے زور دار پنجہ رسید کیا اور وہ وہیں ڈھیر ہو گئی۔\r\nادھر سفید بیل جو اپنی غلطی پر بہت شرمندہ تھا، بھورے بیل سے بولا \" بھائی مجھے معاف کر دو میں لومڑی کی باتوں آکر مغرور ہو گیا تھا ، اگرآج تم نہ ہوتے تو میں شیر کا نوالہ بن جاتا\" بھورے بیل نے آگے بڑھ کر اسے گلے لگا لیا اور بولا \" جب تک ہم اکٹھے ہیں تو کوئی بھی ہمارا کچھ نہیں بگاڑ سکتا\"۔ دونوں پھر سے مل کر ساتھ رہنے لگے اور شیر کی دوبارہ کبھی ہمت نہیں ہوئی کہ وہ ان پرحملہ کرے۔', '09m 47s', '0', '5', 'audio/kYR8uaChP7UG5zS1qP7rD2XKuASXtt6zJiWMO2bu.mp4', '', 'images/5DBFJWEVxWAPM62or8KHlFBlRW0qAn9DmPNcy4LT.png', '3', 'thumbnails/YgSTtMrR9nmB9J40NUeidHPm0L3KTYKHRSMK3bl6.png', '2024-08-27 07:31:29', '2024-10-17 15:41:56'),
(36, 'دو کاہل شہزادے', 'آؤ بچو سنیں کہانی ۔ “دو کاہل شہزادوں کی کہانی”\r\n\r\nایک بادشاہ کے دو بیٹے تھے، لیکن دونوں ہی بہت بگڑ گئے تھے۔ بادشاہ اور ملکہ کے ضرورت سے زیادہ لاڈ پیار نے انہیں بے حد ضدی اور سست بنا دیا تھا۔ ان کو جو بھی چیز پسند آتی، چاہے وہ کتنی ہی قیمتی کیوں نہ ہو، فوراً ان کے لۓ حاضر کی جاتی۔\r\n\r\nاب یہ دونوں شہزادے جوان ہو چکے تھے اس لۓ بادشاہ یہ چاہتا تھا کہ وہ ملک کے کاموں میں اس کی مدد کریں۔ لیکن وہ دونوں ہی انتہائی سست اور کاہل بن چکے تھے،ساری ساری رات جاگتے اور پھر دن بھر سوۓ پڑے رہتے۔ \r\n\r\nبادشاہ کبھی سمجھانے کی کوشش کرتا \"کہ اب بڑے ہو گۓ ہو، اپنی ذمہ داریوں کا احساس کرو\"۔ تو ملکہ آڑے آجاتی اور کہتی \" آپ کیوں ہر وقت ان کے پیچھے پڑے رہتے ہیں؛ ابھی تو میرے شہزادوں کے کھیلنے کودنے کے دن ہیں، جب ذمہ داری پڑے گی تو خود ہی سنبھال لیں گے\"۔ بادشاہ یہ سن کر خاموش ہو جاتا، مگر وہ جانتا تھا کہ ایک اچھے بادشاہ کو ذہین، ہمدرد اور بہادر ہونا چاہۓ اور یہ سب خصوصیات اچھی تعلیم وتربیت سے آتی ہیں۔ وہ دل ہی دل میں کڑھتا رہتا کہ میرے شہزادوں کو اگر صحیح تعلیم و تربیت نہ ملی تو یہ ملک کو کیسے چلائیں گے۔ یوں وقت گزرتا رہا لیکن بادشاہ کی پریشانی کا کوئی حل نہ نکلا۔\r\n\r\nاس بادشاہ کا ملک بہت ہی خوبصورت تھا، اس میں اونچے اونچے پہاڑ، گھنے درختوں کے وسیع جنگل، جگہ جگہ بہتی ہوئی صاف شفاف پانی کی نہریں اور بڑے بڑے سرسبز میدان تھے۔ موسم سرما میں برف باری اور موسم گرما میں انتہائی خوشگوار موسم کی وجہ سے؛ دور دور سے لوگ یہاں سیر وتفریح کے لۓ آیا کرتے۔ ان میں اکثر پڑوس کے ملکوں کے بادشاہ اور ان کے اہل خانہ بھی ہوتے، جنہیں بطور شاہی مہمان کے بادشاہ کے محل میں ہی ٹھرایا جاتا۔ اوران کی خوب مہمان نوازی کی جاتی۔ اسی وجہ سے پڑوسی ملک اس بادشاہ سے بہت خوش تھے اورکبھی اس سے جنگ نہیں کی۔ سب اس کے ساتھ بڑے پرامن طریقہ سے رہتے تھے۔ اس کے ملک کی خوبصورتی اور امن و امان کے چرچے پوری دنیا میں پھیل گئے۔\r\n\r\nیوں ایک دفعہ موسم گرما میں بہت دور دراز کے ملک کا بادشاہ اور ملکہ اپنی بیٹی یعنی شہزادی کے ساتھ وہاں سیر وتفریح کے لۓ آگئے۔ وہ پریوں جیسی شہزادی بہت ہی خوبصورت تھی، جو بھی اسے دیکھتا تو بس دیکھتا ہی رہ جاتا۔ حسب روایت ان کا بہت شاندار استقبال ہوا اور بڑی عزت و احترام سے انہیں شاہی مہمان کے طور پر محل میں ٹھرایا گیا۔ دوسرے ملک کا بادشاہ اور ملکہ ان کی پرخلوص مہمان نوازی سے بہت متاثر ہوۓ۔\r\n\r\nرات کومہمان بادشاہ کے لئے دعوت کا اہتمام کیا گیا تو دونوں سست اور کاہل شہزادے بھی با دل ناخواستہ وہاں موجود تھے۔ اب جو انہوں پیاری سی شہزادی کو دیکھا تو دونوں کے دونوں اس پر فریفتہ ہو گۓ۔ دعوت کے بعد رات کو بڑا شہزادہ اپنی ماں کے پاس آیا اور بولا \" امی حضوروہ شہزادی مجھے بہت پسند ہے اور ہر قیمت پر آپ میری اس سے شادی کروا دیں\" ابھی یہ بات ہو ہی رہی تھی کی چھوٹا شہزادہ بھی وہاں آگیا، اور اس نے بھی وہی بات کی کہ شہزادی اسے بہت پسند ہے اوروہ ہر حال میں اس سے شادی کرنا چاہتا ہے۔ ملکہ  بہت پریشان ہوئی اور سیدھا جاکے بادشاہ کو یہ بات بتا دی۔۔ یہ سن کر بادشاہ بھی پریشان ہو گیا اور دونوں سوچنے لگے کہ آج تک ہم نے شہزادوں کی کوئی فرمائش نہیں ٹالی لیکن اب کیا کریں۔\r\n\r\nبادشاہ بہت دانشمند تھا۔ اگلے روز وہ مہمان بادشاہ اور شہزادی سے ملا اور انہیں ساری بات بتا دی اور یہ بھی بتا دیا کہ دونوں شہزادے بہت سست اور کاہل ہیں اور ملکی امور میں کوئی دلچسپی نہیں لیتے۔  شہزادی بہت سمجھدار تھی اس نے بادشاہ سے کہا کہ آپ پیشان نہ ہوں ،کل شام میں باغ کی سیر کو جاؤں گی تو آپ دونوں شہزادوں سے کہیں کہ مجھ سے آکر مل لیں۔ بادشاہ یہ سن کر مطمئن ہو گیا اور واپس آکر دونوں شہزادوں کو بتا دیا کہ کل وہ اپنی اپنی قسمت آزما لیں۔ کیونکہ شہزادی خود ہی فیصلہ کرے گی کہ اسے کون پسند ہے۔ یہ سن کر دونوں شہزادے بہت خوش ہوۓ۔\r\n\r\n \r\n\r\nرات بھر شہزادی سوچتی رہی کہ ایسے سست اور کاہل شہزادوں سے کیسے جان چھڑائی جاۓ، اس نے خود سے کہا کہ صاف انکار کرنا بھی مناسب نہیں ہو گا کیونکہ ان لوگوں نے ہماری اتنی اچھی مہمان نوازی جو کی ہے ۔ شہزادی کی کچھ سمجھ میں نہ آیا اور وہ سو گئ۔\r\n\r\nاگلی شام کو شہزادے جب اس سے ملنے باغ میں آئے تو شہزادی نے کہا کہ \" آپ دونوں بہت اچھے ہیں دراصل میں  دنیا کے سب سے پڑھے لکھے اور قابل شخص سے شادی کرنا چا ہتی ہوں۔ لہذا آپ میں سے جو بھی زیادہ قابل ہو گا میں اس کا رشتہ قبول کر لوں گی۔\r\n\r\nیہ بات دونوں بادشاہوں تک پہنچی تو انہوں نے فیصلہ کیا کہ شہزادوں کو ایک سال کا وقت دیا جاۓ، جس میں وہ خوب تیاری کریں اور ٹھیک ایک سال بعد اگلے موسم گرما میں دونوں کا مقابلہ ہو جاۓ اور جو زیادہ قابل ہو اس سے شہزادی کا رشتہ طے کر دیا جاۓ۔ سب اس فیصلے پر راضی ہو گئے۔\r\n\r\nپھر کیا تھا دونوں شہزادوں نے دل لگا کر محنت شروع کردی۔ ان کی مدد کے لۓ ملک کے سب سے قابل استادوں کو محل میں ہی رکھ لیا گیا۔ اب وہ شہزادے جو ہر وقت سستی اور کاہلی میں مبتلا رہتے تھے بلکل بدل گئے اور دن رات محنت کرنے لگے۔  بادشاہ یہ دیکھ کر بہت خوش ہوا اور ان کی خوب حوصلہ افزائی کی۔ آخر کار سال بھر کی انتھک محنت کے بعد دونوں شہزادے بہت ہی قابل بن گئے۔ اب وہ پہلے جیسے بیکار نہ تھے بلکہ ملکی امور میں بڑھ چڑھ کر حصہ لینے لگے۔\r\n\r\nمقابلے کا دن بھی آہی گیا، شہزادی اور اس کے والدین بھی حسب وعدہ پہنچ گۓ۔ مقابلہ شروع ہوا توبہت سے عالم فاضل لوگوں نے مشکل سے مشکل سوال پوچھے لیکن دونوں شہزادوں نے سب کو لا جواب کردیا۔ قابلیت کے وہ جوہر دکھاۓ کہ سب حیران رہ گۓ۔ صبح سے شام ہو گئی لیکن یہ فیصلہ نہ ہو سکا کہ ان میں سے کون زیادہ قابل ہے۔ آخر کار مقابلہ برابری پر ختم ہوا۔ سب لوگ پریشان ہو گئے کہ اب کیا ہو گا۔ شہزادی بھی حیران پریشان کھڑی تھی، اس نے تو ان سست اور کاہل شہزادوں سے جان چھڑانے کے لۓ یہ شرط رکھی تھی، مگر یہاں تو کایا ہی پلٹ گئی ۔\r\n\r\nدربار میں گہری خاموشی چھائی ہوئی تھی،اتنے میں دونوں شہزادوں نے آپس میں کچھ مشورہ کیا اوربڑا شہزادہ آگے بڑھ کے بولا۔\" دراصل شہزادی ہم دونوں میں سے کسی سے بھی شادی نہیں کرنا چاہتی تھی اس نے قابلیت کی شرط تو صرف ہم سے پیچھا چھڑانے کے لۓ رکھی تھی۔ لیکن ہم شہزادی کے شکر گزار ہیں کہ اس کی وجہ سےسستی اور کاہلی سے ہماری جان چھوٹ گئی اور ہم نے اپنی ذمہ داریوں کو سمجھ لیا ہے۔\r\n\r\nاپنے دونوں بیٹوں کی ذہانت اور قابلیت پر بادشاہ بہت خوش ہوا۔ اس نے بھی شہزادی کا شکریہ ادا کیا اور اسے بہت سے قیمتی تحفے دئیے۔ شہزادی اور اس کے ماں باپ خوشی خوشی اپنے ملک واپس چلے گئے۔', '08m 53s', '0', '1', 'audio/iZPobJiQdCzIVdiiEsIJDmfbPwRsNqDOs2bNM8xH.mp4', '', 'images/8iXbbsrJep6GTdMLh4pvl9XQdS1PaF5CXgd3FtEO.png', '7', 'thumbnails/TiT36Nu0nmDTmmj4CX25Pum79lfIof8xQyd6W3GD.png', '2024-08-27 07:33:49', '2024-10-15 06:07:44'),
(37, 'دوگنا کرایہ', 'آؤ بچو سنیں کہانی! ” دوگنے کرائے کی کہانی “\r\n\r\n\r\nایک دفعہ گرمیوں کی چھٹیوں میں شہزاد صاحب فیملی کے ساتھ ایک پہاڑی مقام پر گھومنے گئے۔ لمبا سفر طے کر کے شام کو پہنچے تو سب نے آرام کیا اور صبح سویرے اٹھ کر خوبصورت جھیل پر جانے کا پلان بنا لیا۔ جھیل چونکہ بہت دور تھی اور وہاں اپنی کار پر نہیں جایا جا سکتا تھا اس لئے انہوں ایک جیپ بک کرلی۔ جیپ والے سے آنے جانے کا 8 ہزار کرایہ طے ہوا اور وہ جھیل کی طرف روانہ ہو گئے۔\r\n\r\nراستے میں رکتے رکاتے دلکش نظاروں اور خوبصورت موسم سے لطف اندوز ہوتے وہ تقریبا دوپہر کے بعد جھیل پر پہنچے۔ ایسا لگا جیسے جنت میں آگئے ہوں، اردگرد اوںچے اونچے پہاڑ جن کی چوٹیاں برف سے ڈھکی ہوئی تھیں، اوپر نیلگوں آسمان اور نیچے صاف شفاف جھیل تھی۔ سب سے پہلے انہوں کشتی پر بیٹھ کر پوری جھل کا چکر لگایا اور پھر فوٹوگرافی اور سیلفیز کا ایک نہ ختم ہونے والا سلسلہ شروع ہو گیا۔\r\n\r\nاب سب کو بہت بھوک لگ رہی تھی کہ اتنے میں جیپ کے ڈرائیور نے ہارن بجا کر ان کو بلانا شروع کردیا۔ شہزاد صاحب نے جیپ والے سے کہا کہ بھائی سب کو بھوک لگ رہی ہے بس کھانا کھا لیں تو چلتے ہیں۔ جیب والے نے بڑے روکھے سے لہجے میں کہا \" صاحب آپ نے پہلے ہی بہت دیر کر دی ہے، اگر اندھیرا ہو گیا تو 3 گھنٹے کے سفر میں 6 گھنٹے لگ جائیں گے میری ایک اور پارثی شہر میں انتظار کر رہی ہے، اگر وقت پر نہ پہنچے تو میرا بڑا نقصان ہو جائے گا۔ شہزاد صاحب نے کہا کہ اگر ایسی بات تھی تو آپ کو پہلے بتانا چاہئے تھا ہم کسی اور کے ساتھ آجاتے۔ خیر سب کو بہت بھوک لگی ہے بس جلدی سے کھانا کھا لیں تو چلتے ہیں۔\r\n\r\nکھانا بننے میں کچھ وقت لگا لیکن ڈرائیور کا احساس کرتے ہوئے سب نے فٹا فٹ کھانا کھایا اور جی چاہتے ہوئے بھی چائے کو چھوڑکر واپسی کے لئے روانہ ہو گئے۔ ڈرائیور نے غصّہ سے بڑبڑاتے ہوئے انتہائی تیز رفتاری سے گاڑی چلانا شروع کر دی اور جیپ ٹریک پر جھٹکوں سے سب کی طبعیت خراب ہونے لگی۔ اب رات کا اندھیرا پھیل چکا تھا، اچانک جیپ کو جھٹکا لگا اور وہ گہری کھائی میں گرتے گرتے بچی۔ شہزاد صاحب بول اٹھے \" بھائی کیوں اپنی اور ہماری جان خطرے میں ڈاتے ہو، آرام سے چلو؛ زندہ پہنچو گے تو کام کر سکو گے۔ اگر وہ پارٹی اتنی اہم تھی تو تمہیں آنا ہی نہیں چاہئے تھا۔\r\n\r\nڈرائیور بولا؛ \" یہی ہمارا سیزن ہے کام کا، پھر تو پورا سال بیکار رہتے ہیں۔ لیکن آپ نہیں سمجھیں گے اس بات کو؛ یہ کہتے ہوئے اس نے مزید خطرناک ڈرائیونگ شروع کر دی۔ زوردار جھٹکوں اور خوف سے سب کی حالت بگڑنے لگی۔ یہ دیکھ کر شہزاد صاحب نے ڈرائیور سے کہا کہ بھائی احتیاط سے چلاؤ، ہم زندہ پہنچ گئے تو تمہیں نقصان نہیں ہو گا بلکہ کچھ نہ کچھ فائدہ ہی ہو گا۔ یہ سن کر ڈرائیور مطم‏ئن ہو گیا۔ اور آرام سے گاڑی چلانے لگا۔\r\nرات گئے سب واپس ہوٹل پہنچ گئے اور شہزاد صاحب نے اترتے ہوئے ڈرائیور کو طے شدہ رقم سے 2 ہزار زیادہ دے دئیے۔ ڈرائیورغصّہ سے بولا \" آپ کی وجہ سے میرا 10 ہزار کا نقصان ہوا ہے؛ اب میرا نقصان پورا کریں۔ اس پر دونوں کے درمیان زوردار بحث شروع ہو گئی۔ اردگرد لوگ اکٹھے ہوگئے۔ ہوٹل کا اسٹاف اور مینیجر بھی شور سن کر باہر آگئے۔ سب نے ڈرائیور کو سمجھانے کی بہت کوشش کی مگر وہ اپنی بات پر اڑا رہا کہ میرا نقصان پورا کرو۔\r\n\r\nجب تماشہ بہت بڑھ گیا تو لوگوں نے شہزاد صاحب سے گزارش کی کہ اسکو ہزار 2 ہزار اور دیکر فارغ کریں۔ لیکن ڈرائیور نے مزید 2 ہزار لینے سے انکار کر دیا اور مزید شور ہنگامہ کرنے لگا۔ لوگوں نے کہا چلو اس کو تھانے لے جاتے ہیں، وہ فوری تیار ہو گیا۔ مگر شہزاد صاحب اتنی معمولی بات پر تھانے جا کر اپنا ٹرپ خراب نہیں کرنا چاہتے تھے اس لئے کافی بحث مباحثہ کے بعد 8 ہزار اضافی ادا کرکے جان چھڑائی۔\r\n\r\nشہزاد صاحب کا سارا موڈ خراب ہو گیا، تھکن کے باوجود وہ رات بھر سو نہیں پائے اور صبح ہوتے ہی شہر میں جیپوں کے اڈے پر چلے گئے۔ وہاں ان کی ملاقات اڈے کے انچارج سے ہوئی جو ایک سمجھدار آدمی لگتا تھا۔ شہزاد صاحب نے اسے تفصیل سے ساری بات بتائی۔ جس پر اس نے جواب دیا کہ ہر ٹورسٹ جو پہلی دفعہ یہاں آتا ہے اور ڈرائیور کے ساتھ آنے جانے کے وقت کا تعین نہیں کرتا اس کے ساتھ یہ لوگ ایسا ہی کرتے ہیں۔ اڈہ انچارج نے اسکی وجہ یہی بتائی کہ \"یہاں صرف سیزن میں کام ہوتا ہے اور باقی پورا سال کوئی کام نہیں ملتا؛ اس لئے ان کی کوشش ہوتی ہے کہ کسی بھی طریقہ سے زیادہ سے زیادہ کما لیں تاکہ فارغ وقت میں ان کا نظام زندگی چلتا رہے۔\r\n\r\nشہزاد صاحب کو جب حقیقت کا پتہ چلا تو انہیں بہت دکھ ہوا۔ وہ کہنے لگے کہ ان کی مجبوری تو ہے مگر یہ طریقہ ٹھیک نہیں، اس طرح تو آہستہ آہستہ لوگ یہاں آنا چھوڑ دیں گے اور یہ بیچارے سیزن کی کمائی سے بھی جائیں گے۔ اڈہ انچارج نے بتایا \" یہاں پہ تقریبا 50 کے قریب جیپ ڈرائیور ہیں ان میں سے 10 سے 12 لوگ ایسے ہیں جو اس طرح پیسہ کمانے کو جائز نہیں سمجھتے اور بہت ایمانداری سے کام کرتے ہیں۔ لیکن یہ بیچارے آف سیزن میں بہت پریشان رہتے ہیں۔\r\n\r\nشہزاد صاحب نے کچھ سوچنے کے بعد پوچھا کہ \"کیا آپ مجھے ان ایماندار ڈرائیورز سے ملوا سکتے ہیں\"، اس نے جواب دیا \"جی ابھی کچھ دیر میں سب آ جائیں گے تو میں آپکو ملوا دوں گا۔ کچھ ہی دیر میں سب ڈرائیور اپنی گاڑیوں کے ساتھ اڈے میں آگئے تو انچارج نے انہیں شہزاد صاحب سے ملوایا اور انہیں سارا واقعہ سنایا۔ وہ بہت شرمندہ لگ رہے تھے۔\r\n\r\nشہزاد صاحب نے ان 10 ایماندار ڈرائیوروں سے کہا کہ اگر آپ میرا ساتھ دیں تو ہم اس مسئلہ کا حل نکال سکتے ہیں جس سے آپکے آف سیزن میں روزگار نہ ہونے کی مشکل بھی حل ہو سکتی ہے۔ اس میں تھوڑا وقت تو لگ جائے گا لیکن امید ہے یہ مسئلہ ہمیشہ کس لئے حل ہو جائے۔ وہ سب یہ سن کر بہت خوش ہوئے اور ساتھ دینے کے لئے رضامند ہو گئے۔\r\n\r\nشہزاد صاحب بولے آپ سب نے ایک چھوٹا سا کام کرنا ہے اور وہ یہ کہ اپنے گھر میں یا گھر کے باہر 8 سے 10 شہتوت کے پودے لگانے ہیں اور ایک سال تک ان کی خوب دیکھ بھال کرنی ہے۔ ویسے بھی اس علاقے میں بارشیں زیادہ ہوتی ہیں تو سال ، دو سال میں یہ درخت پھل دار ہو جائیں گے۔ سب یہ بات سن کر حیران رہ گئے کہ شہتوت کے درختوں سے ان کا مسئلہ کیسے حل ہو گا۔ شہزاد صاحب نے گفتگو جاری رکھی اور بولے میں اگلے برس دوبارہ آؤں گا اور آپ سب کو شہتوت کے ہر پھل دار درخت کے بدلے 2 اصیل انڈوں والی مرغیاں اور ایک مرغا تحفے میں دوں گا۔\r\nایک ڈرائیور پر جوش انداز میں بولا \" یعنی اگر میرے 10 درخت ہوں گے تو مجھے 20 اصیل مرغیاں اور 4 مرغے ملیں گے\"۔ دوسرے ڈرائیور نے پہلے سے کہا \"بھائی یہاں تو اپنے لالے پڑے ہیں اتنی مرغیوں کی خوراک کون پوری کرے گا؟ شہزاد صاحب نے ران پہ ہاتھ مارا اور پرجوش انداز میں بولے، یہ ہوئی نہ بات؛ صحیح سوال کیا ہے آپ نے۔ جناب سب غور سے سنیں شہتوت کا ایک جوان درخت کم از کم 2 مرغیوں کی خوراک کے لئے کافی ہے، بس اس کے پھل کو صحیح طرح سے خشک کر کے محفوظ کرلیں۔ مرغیاں موسم گرما میں تو خود ہی دانہ دنکا چن لیتی ہیں جبکہ سردیوں میں یہ خشک شہتوت نہ صرف ان کی خوراک کے کام آئیں گے بلکہ ان کے استعمال سے مرغیاں زیادہ سے زیادہ انڈے دیں گی۔ جن کو بازار میں فروخت کر کے اچھی آمدنی حاصل کی جا سکتی ہے۔ خرچہ بھی کوئی نہیں بس شروع میں تھوڑے تحمل اور سنجیدگی سے کوشش کرنی ہے۔\r\nدیکھیں بھائی میں جانتا ہوں کہ سوچنے میں یہ کچھ عجیب سا لگ رہا ہے، لیکن یقین رکھیں یہ بہت کارآمد اور آزمودہ حل ہے۔ ویسے بھی ہاتھ پہ ہاتھ دھرے اپنی قسمت کو کوسنے سے بہتر ہے کہ کوشش کی جائے۔ سب ڈرائیور شہزاد صاحب کی گفتگو سے بہت متاثر ہوۓ اور انہوں نے درخت لگانے کی حامی بھر لی۔\r\n\r\nاگلے روز وہ واپس اپنے شہر چلے گئے، لیکن مستقل ان سے رابطے میں رہے۔ سب نے خوب دل لگا کر پودوں کی حفاظت اور افزائش کی۔ دوسرے ڈرائیور ان کا مذاق اڑاتے رہے لیکن انھوں نے کسی کی پرواہ نہیں کی۔ آخر ایک سال گزر گیا شہتوت کے پودوں نے تھوڑا قد نکال لیا لیکن پھل نہ ہونے کے برابر تھا۔ کچھ لوگ تھوڑا مایوس ہوئے مگر شہزاد صاحب نے انہیں حوصلہ دیا اور کہا ابھی ایک سال اور آپ کو صبر کرنا پڑے گا میں اگلے برس آپ کے پاس آؤں گا۔\r\n\r\nآخر ایک سال اور بھی گزر گیا اب شہتوت کے درختوں پر بھر پور پھل آیا۔ شہزاد صاحب بھی اصیل مرغیوں کا ایک چھوٹا ٹرک ان کے لئے لے آئے۔ وہ سب بہت خوش ہوۓ۔ دیکھتے ہی دیکھتے ان کے گھر میں دیسی انڈوں کا ڈھیر لگ گیا۔ خود بھی کھائے اور پڑوس میں بھی بانٹے۔ کچھ اصیل چوزے بھی نکال لئے۔ اب ان اصیل چوزوں اور انڈوں کی فروخت سے انہیں اچھی خاصی آمدنی شروع ہو گئی اور وہ خوشحال ہونا شروع ہو گئے۔\r\n\r\nاب وہ ڈرائیور جو پہلے ان کا مذاق اڑاتے تھے خود بھی اسی کام پر شروع ہو گئے، یوں چند سالوں میں ان سب کے حالات بہتر ہو گئے۔ انھوں نے ٹورسٹ سے دوگنا کرایہ وصول کرنے کے حربے بھی چھوڑ دئیے اور ٹورازم نے مزید فروغ پایا جس سے سب کو فائدہ پہنچا۔ سب نے شہزاد صاحب کو بہت دعائیں دیں۔\r\n\r\nیہ بات مشہور ہوتے ہوتے حکومت تک جا پہنچی تو شہزاد صاحب کی بے لوث خدمات کے اعتراف میں حکومت نے نہ صرف انہیں صدارتی تمغہ سے نوازا بلکہ انھیں دیگر علاقوں میں ایسے ہی پراجیکٹ شروع کرنے کے لئے مالی اور حکومتی معاونت بھی فراہم کی۔', '12m 09s', '0', '8', 'audio/CZ4gD4tejKb1EOANIGVnI3hGxEzSj3gKTdxgDXi1.mp3', '', 'images/nY7vp5v1I1IOTpWL8NiuBN1WKWOWZuTM62gd9ffX.png', '10', 'thumbnails/Rizvw7a1CG6sfNdZ9esxSCs33tGOCab2mupLfw2O.png', '2024-08-27 07:35:36', '2024-10-15 06:08:07'),
(38, 'گدھے کے کانوں والا شہزادہ', 'آؤ بچو سنیں کہانی – “گدھے کے کانوں والے شہزادے کی کہانی”ایک بادشاہ کی کوئی اولاد نہ تھی۔ اسے بچوں سے بہت پیار تھا۔ وہ چاہتا تھا کہ اس کے ہاں بھی کوئی بچہ ہو جوسارے محل میں کھیلتا پھرے۔ آخر اس نے پریوں سے مدد چاہی۔ وہ جنگل میں گیا۔ وہاں تین پریاں رہتی تھیں۔ اس نے جب پریوں کو اپنا حال سنایا توپریوں نے کہا کہ ایک سال کے اندر اندر تمہارے ہاں ایک شہزادہ پیدا ہوگا۔بادشاہ یہ سن کر بہت خوش ہوا۔ محل میں آ کر اس نے ملکہ کو یہ خوشخبری سنائی اور سارے ملک میں خوشیاں منائی گئیں۔ پھر پورے ایک سال اور ایک دن بعد بادشاہ کے ہاں بیٹا پیدا ہوا۔ رات کو تینوں پریوں نے آکر شہزادے کو تحفے دئیے۔پہلی پری نے کہا “تم دنیا کے سب سے خوبصورت شہزادے ہو گے”۔دوسری پری نے کہا “تم دنیا کے سب سے عقلمند اور نیک دل شہزادے ہو گے “۔تیسری پری نے سوچا کہ ان پریوں نے دنیا کی تمام خوبیاں شہزادے کو دے دی ہیں، ایسا نہ ہو کہ یہ مغرور ہو جائے۔ اس نے کہا “شہزادے۔ تمہارے گدھے جیسے کان ہوں گے تاکہ تم مغرور نہ ہو جاؤ”۔ اس کے بعد تینوں پریاں غائب ہو گئیں۔شہزادہ بہت خوبصورت، عقل مند اور نیک دل تھا۔\r\n\r\n۔ لیکن اس کے ساتھ ہی اس میں ایک عیب بھی تھا۔ اس کے کان بلکل گدھے جیسے تھے۔ لمبے لمبے اور بھدے۔ بادشاہ نے اس ڈر سے کہ کہیں لوگوں کو معلوم نہ ہو جائے، بہت دنوں تک شہزادے کی حجامت ہی نہیں کروائی۔ لیکن ایک نہ ایک دن اس کی حجامت تو ہونی ہی تھی۔آخر بہت سوچ سوچ کے بادشاہ نے ایک نائی کو بلوایا اور اسے محل ہی میں رکھ لیا۔ اس کا کام صرف یہ تھا کہ وہ صرف شہزادے کے بال کاٹے گا اور کسی کو یہ نہیں بتائے گا کہ اس نے کیا دیکھا ہے۔نائی بہت خوش تھا۔ اس نے وعدہ کیا کہ وہ کسی کو شہزادے کے بارے میں کچھ نہیں بتائے گا۔ لیکن شہزادے کے لمبے کانوں کے راز کا بوجھ اس کے سینے پر پتھر کی طرح رکھا ہوا تھا اور وہ چاہتا تھا کہ یہ راز کسی کو بتا کر دل کا بوجھ ہلکا کرے۔آخر ایک دن تنگ آکر وہ ایک بابا جی کے پاس گیا اور انہیں ساری بات بتا دی۔ بابا جی نے کہا \" جنگل میں جا کر ایک گڑھا کھودو اور اس گڑھے کو سب کچھ بتا دو۔ اس طرح تمہارے دل کا بوجھ ہلکا ہو جائے گا۔\"نائی نے جنگل میں جا کر ایک گڑھا کھودا اور گڑھے کو سارا راز بتا دیا۔ اس کے بعد اس کے دل کا بوجھ ہلکا ہو گیا۔ اور وہ خوش خوش محل میں واپس آگیا۔بچو! اب ایک عجیب بات ہوئی۔ جس جگہ نائی نے گڑھا کھودا تھا وہاں ایک سرکنڈہ اگ آیا اور وہ روز بروز لمبا ہوتا گیا۔ ایک دن ایک گڈریا ادھر سے گزرا۔ اس نے اتنا لمبا سرکنڈہ دیکھا تو اسے کاٹ کر بانسری بنا لی۔ جب وہ بانسری بجاتا تو اس میں سے آوازنکلتی:یہی کہے ہر ایک زبان شہزادے کے گدھے کے کان ہوتے ہوتے یہ خبر سارے شہر میں پھیل گئی۔ یہاں تک کہ بادشاہ کو بھی پتہ چل گیا۔ اس نے گڈریے کو محل میں بلوایا اور اپنے سامنے بانسری بجوائی۔ گڈریے نے ڈرتےڈرتے جیسے ہی بانسری بجائی، اس میں سے آواز آئی۔ یہی کہے ہر ایک زبان شہزادے کے گدھے کے کان بادشاہ یہ سن کر غصے میں آ گیا۔ اس نے سوچا یہ بات سوائے نائی کے اور کسی کو معلوم نہ تھی۔ ضرور اسی نے گڈریے کو بتائی ہے۔ بادشاہ نے سپاہیوں کو حکم دیا کہ فورا\" نائی کوگرفتار کر کے قید میں ڈال دیا جائے۔\"یہ سن کر شہزادہ آگے بڑھا اور ہاتھ باندھ کر بولا:\" حضور، آپ بچارے نائی کو سزا کیوں دے رہے ہیں؟ اس نے سچی بات کہی ہے۔ آپ نے جو کچھ اتنے سال چھپائے رکھا ہے۔ اب اسے لوگوں کو دیکھنے دیجئیے۔ خدا نے چاہا تو میں اس عیب کے ہوتے ہوئے بھی اپنی رعایا کا محبوب بادشاہ ہوں گا۔ \" یہ کہہ کر شہزادے نے سر سے ٹوپی اتار دی۔بادشاہ کا دل پسیج گیا۔ اس نے نائی کو معاف کر دیا۔ اسی وقت ایک عجیب بات ہوئی۔ شہزادے کے گدھے جیسے لمبے لمبے کان غائب ہو گئے اور ان کی جگہ انسانوں جیسے کان آ گئے۔ اصل میں بچو ںبات یہ ہوئی کہ! شہزادے کی سچائی اور نیکی کو دیکھ کر تیسری پری کو معلوم ہو گیا تھا کہ یہ شہزادہ مغرور نہیں ہو گا۔ اس لئے اس نے گدھے جیسے کانوں والی بد دعا واپس لے لی تھی۔', '05m 12s', '0', '2', 'audio/SJpKUaCGZj8mHukOpXNKmCTr8myz1bQxfJNYn8Ki.mp3', '', 'images/786y2lXLVIyD7PpLkrUiKeWfeTcLLh7EFHfYMl3w.png', '3', 'thumbnails/xFbRJHcVvixikEIOz7R0uCTBk5xFO9sA5nCcpeMU.png', '2024-08-27 07:38:15', '2024-10-15 09:05:42');
