(39, 'گوسپ والی باجی', 'آؤ بچو سنیں کہانی! ” گوسپ والی باجی کی کہانی “\r\n\r\n\r\nجنید کے گھر شام کی چائے پر سب گھر والے اکٹھے ہو کر خوب گپ شپ لگاتے، اس کی باجی رانیہ، امّی، ابّو اور دادا جان بھی آجاتے۔ امّی چائے کے ساتھ مزے مزے کے سنیکس بنا لیتیں، ایسے میں دادا اور ابّو کے درمیان ہونے والی گفتگو بہت ہی دلچسپ ہوتی۔ یہ محفل مغرب کی اذآن کے ساتھ ہی ختم ہو جاتی، دادا اور ابّو مسجد چلے جاتے، اکثر جنید بھی ان کے ساتھ چلا جاتا۔\r\n\r\nاس کے بعد امّی اور باجی کی نئی محفل شروع ہو جاتی جس میں اکثر کسی نہ کسی کی برائی ہو رہی ہوتی۔ جب کبھی جنید بھی وہاں موجود ہوتا تو اسے بہت برا لگتا۔ اور وہ ڈرتے ڈرتے کہتا \" باجی؛ کسی کی برائی کرنا اچھی بات تو نہیں\" تو باجی اسے خونخوار نظروں سے گھورنے لگتیں۔ ایسے میں وہ پتلی گلی نکل لیتا، اور پیچھے سے باجی کی آواز آتی \" بڑا آیا؛ اب یہ بڑوں کو سمجھائے گا، پدی نہ پدی کا شوربہ ۔ اور پھر سے وہی کہانی؛ فلاں نے یوں کیا اور فلاں کو یوں کرنا چاہئیے۔\r\n\r\nباجی اور امّی کی اس عادت سے ابّو بھی چڑتے تھے، اس لئے ان کی موجودگی میں ایسی گفتگو سے پرہیز کیا جاتا تھا۔ ورنہ کبھی پڑوسی توکبھی رشتہ دار، کبھی ابّو کے دوست اور کوئی نہ ملے تو گھر کی کام والی ہی سہی۔ کوئی ان سے بچ نہیں پاتا تھا۔ ان کی باتوں سے ایسا لگتا کہ ساری دنیا خراب اور وہ خود بہت ہی معصوم ہیں، ان سے تو کبھی کوئی غلطی ہو ہی نہیں سکتی۔ جو بھی سامنے سے اٹھ کر جاتا پیچھے اس کی برائیاں شروع۔\r\n\r\nباجی کی اس عادت سے ابّو بہت پریشان رہتے اور اکثر امّی سے کہتے \" اپنی بیٹی کو سمجھائیں ہر وقت دوسروں میں عیب تلاش نہ کیا کرے، اس سے فساد ہوتا ہے۔ کل کو اس کی شادی ہونی ہے وہاں بھی یہی کام کئے تو اس کا گھر کیسے بسے گا\"۔ امّی بھی باجی کو سمجھاتیں؛ مگر ان کے تو کان پہ جوں بھی نہ رینگتی۔\r\n\r\nایک دن ابّو آفس سے آئے تو بہت خوش تھے، انھوں نے امّی سے کہا کہ کل شام کی چائے پر میرے ایک دوست کی فیملی آرہی ہے رانیہ کے رشتے کے لئے۔ ان کا لڑکا بہت نیک اور شریف ہے، سوفٹ وئیر انجینئر ہے اور آن لائن کام کرکے اچھا کما لیتا ہے ۔ اس کی والدہ نے کسی فنکشن میں رانیہ کو دیکھا اور اب وہ اس کا ہاتھ اپنے بیٹے کے لئے مانگنا چاہ رہی ہیں۔ امّی یہ سن کر بہت خوش ہوئیں اور باجی شرما کر اپنے کمرے میں دوڑ گئیں۔\r\n\r\nاگلے روز ابّو نے آفس سے چھٹی کر لی اور امّی کے ساتھ مل کرگھر کی بہترین سی سیٹنگ کی اور شام کی چائے کے لئے پرتکلف اہتمام کیا۔ جب مہمان آئے تو سب نے ان کا پرجوش استقبال کیا۔ ان کی فیملی میں انکل، آنٹی، مسرور بھائی اور دو چھوٹی بہنیں ارج اور خرد تھیں۔ مسرور بھائی کی بہت نائس پرسنیلٹی تھی۔ رانیہ باجی بھی اس دن تیار ہو کر بہت پیاری لگ رہی تھیں۔\r\n\r\nخیر وہ مرحلہ بھی آگیا جب باجی چائے کی ٹرے لئے اندر داخل ہوئیں اور سب کو چائے پیش کرنے لگیں۔ مسرور بھائی چوری چوری نظروں سے انہیں دیکھ رہے تھے، شاید ان کو باجی پسند آ گئی تھیں اسی لئے انہوں نے آنکھوں ہی آنکھوں میں اپنی والدہ کو اشارہ کیا جیسے وہ اس رشتہ کے لئے رضامند ہوں۔ آنٹی نے ابّو سے کہا \"بھائی صاحب؛ آپ کی بچی ہمیں بہت پسند ہے؛ ہم اپنے مسرور کے لئے اس کا رشتہ مانگنا چاہ رہے ہیں۔ ابّو نے جواب دیا؛ \"جی بھابی آپ کا بہت شکریہ، ہمیں کچھ وقت دیجئے سوچنے کے لئے ہم مشورہ کر کے آپ کو بتاتے ہیں\"۔\r\n\r\nباجی تو پہلے ہی شرما کر اندر چلی گئیں تھیں، امّی بھی کچھ لینے کچن میں آئیں تو باجی نے خوشی سے انہیں گلے لگا لیا۔ اتنے میں مسرور بھائی کی دونوں بہنیں باجی سے ملنے اندر آئیں توانہیں کچن سے باجی اور امّی کی آواز آئی۔ باجی حسب عادت شرو‏ع تھیں۔ امّی مسرور تو مجھے بہت پسند آئے ہیں لیکن ان کی یہ چڑیل جیسی دو بہنیں؛ انہیں کیسے برداشت کروں گی۔ امّی نے سمجھاتے ہوئے کہا \" ارے بیوقوف یہ تو اپنے گھروں کی ہو جائیں گی، پھر تم راج کرنا اکیلے۔ ارج اور خرد جو یہ ساری گفتگو سن چکی تھیں الٹے پاؤں واپس ہو گئیں۔\r\n\r\nکچھ دیر بعد جلد جواب کے وعدے پر مہمان واپس چلے گئے۔ سب بہت خوش تھے، امّی اور ابّو رات دیر تک آپس میں گفتگو کرتے رہے اور باجی چھپ چھپ کر وہ باتیں سننے کی کوشش کرتی رہیں۔ اگلے روز جب ابّو آفس سے واپس آئے تو ان کا موڈ بہت خراب تھا اور وہ سیدھا اپنے کمرے میں چلے گئے، امّی بھی تیزی سے ان کے پیچھے چلی گئیں۔\r\n\r\nکچھ دیر بعد امّی کمرے سے نکلیں تو بہت اداس تھیں، جنید اور باجی دونوں آگے بڑھے کہ جان سکیں؛ آخر کیا بات ہوئی ہے۔ امّی نے ڈانٹ کر باجی سے کہا \" تمہیں کتنا سمجھایا کہ ہر وقت الٹی سیدھی باتیں مت کیا کرو اور میں پاگل بھی تمہارے ساتھ شروع ہو جاتی ہوں۔ کل ہم کچن میں مسرور کی بہنوں کے بارے میں جو باتیں کر رہے تھے وہ انہوں نے سن لی تھیں۔ اسی لئے لڑکے والوں نے رشتہ سے انکار کردیا ہے۔ یہ سن کر باجی تو سکتے میں آ گئیں۔\r\n\r\nاس دن کے بعد سارا گھر ہی غمزدہ ہو گیا، اب شام کی چائے پر بھی اکٹھے نہیں ہوتے تھے۔ باجی بھی ہر وقت افسردہ اپنے کمرے میں بند رہتی تھیں۔ خیر آہستہ آہستہ زندگی معمول پر آنے لگی اور بظاہر سب اس معاملے کو جیسے بھول گئے۔ باجی بھی نارمل ہو گئیں۔ باجی نے پھر وہی نقطہ چینی شروع کردی، مگر اب امّی اکثر باجی کو ٹوک دیتیں۔\r\nپھر باجی سہیلیوں کے ساتھ گھنٹوں فون پر لگی دوسروں کی برائیاں کرتی رہتیں؛ ان کی یہ عادت اتنی پکی ہوچکی تھی کہ لاکھ سمجھانے کے باوجود بھی کوئی اثر نہیں ہوتا تھا۔\r\n\r\nایک دن سکول سے چھٹی کے وقت مسرور بھائی جنید سے ملے۔ ان کے ہاتھ میں ایک پنجرہ تھا جس میں ایک گرے رنگ کا طوطا تھا۔ مسرور بھائی نے جنید کو تفصیل سے کچھ سمجھایا اور وہ طوطا اس کے حوالے کر دیا۔ جنید جب طوطا لے کر گھر پہنچا تو باجی کو وہ بہت پسند آیا اور وہ بار بار کہنے لگیں \" واؤ کتنا پیارا ہے یہ\"۔ کچھ دیر بعد جب باجی نے پھر اپنا جملہ دھرایا تو طوطے نے بلکل باجی کے لہجے میں نقل اتاری \"واؤ کتنا پیارا ہے یہ\" سب بہت حیران رہ گئے۔ جنید نے بتایا کہ یہ افریقن گرے پیرٹ ہے اس کے سامنے جو بات کی جائے یہ ہوبہو اسی لہجے میں دہرا دیتا ہے۔ یہ سن کر سب بہت خوش ہوئے۔\r\n\r\nپھر ایسا ہوا کہ باجی جب بھی کسی کی برائیاں کرتیں، طوطا ان کے لہجے میں من وعن انہیں دہرا دیتا۔ اس سے باجی چڑنے لگیں اور اکثر اس کے سامنے خاموش رہتیں۔ گھر میں کچھ سکون سا محسوس ہونے لگا۔\r\n\r\nکہتے ہیں یہ گوسپ کی عادت اتنی بری ہے کہ اپنے پرائے کا لحاظ نہیں کرتی۔ پھر ایک دن ایسا ہی ہوا \"باجی اپنے کمرے میں فون پر اپنی کسی دوست سے امّی کی برائیاں کر رہی تھیں\"۔ جنید نے چپکے سے طوطے کو وہاں رکھ دیا۔ کچھ دیر بعد جب امّی وہاں آئیں تو باجی تو خاموش ہوگئیں مگر طوطے نے جو سنا تھا باجی کے لہجے میں زور زور سے دہرانے لگا۔ امّی کو یہ سب سن کر بہت افسوس ہوا اور باجی شرم سے پانی پانی ہوگئیں۔\r\n\r\nامّی رونے لگیں اور کہا بیٹا مجھے بہت دکھ ہوا اپنے بارے میں تمہاری رائے سن کر۔ باجی کی نظریں شرم سے زمین پہ گڑھ گئیں۔ کچھ دن امّی اور باجی میں بول چال بند رہی۔ آخر کار باجی نے دل سے اپنی غلطی کو تسلیم کر لیا۔ امّی سے معافی مانگی اور سچی توبہ کی کہ وہ آئندہ کبھی گوسپ نہیں کریں گی۔\r\n\r\nجنید نے ساری بات مسرور بھائی کو بتائی اورطوطا انہیں واپس کر دیا۔ پھر انہوں نے جنید کو باجی کے لئے کچھ ناول اور کتابیں دیں۔ باجی کو وہ کتابیں بہت پسند آئیں اور اب وہ اکثر انہیں کتابوں کے موضوعات پر گفتگو کرتیں۔ شام کی چائے پر سب کو نئی نئی اور دلچسپ کہانیاں سناتیں۔ سارے گھر والے ان کی باتوں سے بہت محظوظ ہوتے۔ یوں انہیں گاسپ کی بری عادت سے چھٹکارہ مل گیا۔\r\n\r\nاگلی ملاقات پر جنید نے ساری صورتحل مسرور بھائی کو بتائی اوران کا بہت شکریہ ادا کیا کہ ان کی وجہ سے باجی اور سب گھر والوں کی زندگی میں کتنی خوشگوار تبدیلی آگئی۔ مسرور بھائی نے کہا \" دراصل بعض لوگوں کو گفتگو کرنے کا بہت شوق ہوتا ہے لیکن مطالعہ اورموضوعات کی کمی انہیں گاسپ پر لگا دیتی ہے، اگر وہ کتاب سے دوستی کر لیں تو دوسروں کے بارے میں بیکار گفتگو چھوڑ دیتے ہیں۔\r\n\r\nجنید مسرور بھائی کی باتوں سے بہت متاثر ہوا اور ان کی اجازت سے طوطے اور کتابوں کا سارا معاملہ گھر والوں کو بتا دیا۔ امّی، ابّو کو جب حقیقت کا پتہ چلا تودونوں بہت خوش ہوئے اور باجی نے کہا \"جنید کے بچے ابھی مزا چکھاتی ہوں تمہیں\" اور اسے دبوچ کر دھیرے سے اس کے کان میں کہا \" اپنے مسرور بھائی کو میری طرف سے شکریہ کہنا، میں ساری زندگی ان کی احسان مند رہوں گی۔\r\n\r\nاتنے میں گھر کی گھنٹی بجی، دروازہ کھلا تو مسرور بھائی مٹھائی کا ٹوکرا لئے انکل، آنٹی اور دونوں بہنوں کے ساتھ موجود تھے۔ سب نے بڑھ کر انہیں خوش آمدید کہا۔ امّی ابّو نے مسرور بھائی کو پیا رکیا۔ باجی نے آگے بڑھ کر ارج اور خرد سے اپنی غلطی پر معافی مانگی اور ان دونوں نے سچے دل سے باجی کو معاف کرکے انہیں گلے لگا لیا۔ انکل اورآنٹی نے بھی باجی کو پیار کیا اور مسرور بھائی کے لئے پھر سے ان کا باتھ مانگ لیا۔\r\n\r\nامّی ابّو نے فورا\" ہاں کردی؛ دونوں بہت خوش اور مطمئن تھے کہ ان کی بیٹی کے لئے اتنا سمجھدار اور کئیرنگ لائف پارٹنر مل گیا ہے', '12m 23s', '0', '2', 'audio/mKygmYXxE0TUMUqpwHezkGgyOEx301X6dalayWqC.mp3', '', 'images/QV9rmmEjzvzimpQOaMXu8OIjVK7uhXLCw1uv97UG.png', '10', 'thumbnails/qR3SgAwu1F719JNdAyJDL3K4fRrBkOq5S9N8hrSU.png', '2024-08-27 07:41:10', '2024-10-15 06:08:45'),
(40, 'میٹھی سی خوشی', 'آؤ بچو سنیں کہانی ۔ ” میٹھی سی خوشی کی کہانی “\r\n\r\nمیں ایک آم ہوں، میری خوبصورتی اور میٹھے رسیلے ذائقے کی وجہ سے دنیا مجھے پھلوں کا بادشاہ کہتی ہے۔ یوں تو سب ہی مجھے شوق سے کھاتے ہیں لیکن چھوٹے چھوٹے پیارے بچے جب مجھے خوب مزے سے کھاتے ہیں تو مجھے بہت اچھا لگتا ہے۔ ان کے نازک نازک دانت جب مجھے چھوتے ہیں تو مجھے گدکدی سی ہونے لگتی ہے اورمیری گٹھلی ان کے ہاتھوں سے پھسل جاتی ہے۔ جب وہ مجھے اپنے ہاتھوں اور منہ پر مل لیتے ہیں۔ اور آم کھاتے کھاتے خود ہی آم بن جاتے ہیں تو امّی ابّو کو ان پہ بہت پیار آتا ہے۔ وہ فٹافٹ ان کی تصویر بنا لیتے ہیں یوں یہ آم زندگی بھر انکی ایلبم میں ایک میٹھی سی خوشی بن کرموجود رہتا ہے۔\r\n\r\nمیں ایک آم ہوں جب میں درخت پر نکلا تو خوب بارشیں ہوئیں اور آندھیاں بھی چلیں، مگر میں مظبوطی سے درخت پہ لٹکا رہا۔ کبھی میں پتوں کے درمیان چھپ جاتا اور کبھی پتے مجھے آغوش میں چھپا لیتے۔ یوں وقت گزرتا رہا اور دن بدن میں بڑا ہونے لگا۔ اب شدید گرمی کا موسم آگیا اور میرے ارد گرد کے آم پکنے لگے، میں چونکہ تھوڑی دیر سے نکلا تھا اس لئے میرے پکنے میں ابھی کچھ وقت باقی تھا۔\r\nایک دن مالی بابا آئے اور دوسرے پکے آموں کے ساتھ مجھے بھی توڑ لیا۔ میں لاکھ چیخا کہ میں ابھی تیار نہیں ہوں لیکن مالی بابا نے میری ایک نہ سنی اور مجھے پکے آموں کی پیٹی میں نیچے رکھ کرفرٹ منڈی بھیج دیا۔ وہاں سے ہماری بند پیٹی ایک فروٹ والے نے خرید لی۔ اب جو اس نے اپنی دوکان پہ لا کر پیٹی کو کھولا تو مجھے دیکھ کر برا سا منہ بنا لیا اور پپٹی میں ہی ایک طرف چھپا کر رکھ دیا۔ لوگ آتے رہے اور مزے مزے کے پیلے پیلے آم لے جاتے رہے۔ مجھ پر جس کی بھی نظر پڑتی وہ ناک بھوں چڑھا کر مجھے ایک طرف کردیتا۔ سارا دن گزر گیا نہ میں بکنا چاہتا تھا اورنہ ہی کوئی مجھے خریدنا چاہتا تھا۔\r\nاتنے میں ایک صاحب نے گاڑی سے آواز لگائی \" ارے بھائی پھل والے دو کلو میٹھے میٹھے آم دے دو\"، پھل والے نے نظر بچا کر مجھے بھی تھیلے میں ڈال دیا، میں پھر سے چلایا کہ میں تو ابھی پوری طرح میٹھا آم نہیں بنا آپ مجھے کیوں اس تھیلے میں ڈال رہے ہیں۔ پھل والے نے میری ایک نہ سنی اور تھیلے کو اوپر سے گرہ لگا کر گاہک کو دے دیا۔ گاہک بھی بڑا سیانا تھا اس نے مجھ سمیت دو تین آم نکالے اور پھل والے سے کہا \"یہ تبدیل کردو\"۔ میں پھر سے پیٹی میں واپس آگیا لیکن شکر ادا کیا کہ میری وجہ سے کسی کے منہ کا ذائقہ خراب نہیں ہوا۔ رات کو دوکان بند کرنے سے پہلے پھل والے نے مجھے اور چند اور میرے جیسے آموں کو اخبار میں لپیٹ کرایک پیٹی میں مظبوطی سے بند کر دیا اور اس پیٹی کو ایک بند اور گرم جگہ پر رکھ دیا۔ میں جو تازہ ہواؤں میں پلا بڑھا تھا یہاں میرا دم گھٹنے لگا۔ شدید گرمی اور حبس نے ہمارا جینا دوبھر کر دیا۔ لیکن جلد ہی مجھے محسوس ہوا کہ اس طرح میں جلدی پک رہا ہوں اور میرا رس بہت تیزی سے مٹھاس میں بدل رہا ہے۔ اس لئے میں نے صبر سے برداشت کیا۔\r\nیوں دو دن بعد جب پھل والے نے پیٹی کو کھولا تو سب سے پہلے اس کی نظر مجھ پر پڑی، میں مٹھاس سے بھر پور پیلا زرد آم بن چکا تھا ، وہ مسکرایا اور مجھے سجا کر سب کے سامنے رکھ دیا۔ میں خوشی سے جھوم اٹھا۔ صبح صبح پہلے ہی گاہک نے مجھے خود اپنے ہاتھوں سے اٹھا کر اپنے تھیلے میں ڈالا اور پھر دوسرے آموں کے ساتھ مجھے اپنے گھر لے آیا۔ میں اوردوسرے آم بھی بیگ میں جھول رہے تھے اور خوشی سے پھول رہے تھے۔\r\nگھر پہنچتے ہی ہم امّی کے ہاتھ میں چلے گئے، انہوں نے ہمیں دھو کر صاف ستھرا کیا اور ایک باسکٹ میں ڈال کر ہمیں ٹھنڈے ٹھنڈے فریج میں رکھ دیا۔\r\nبچو! بڑا ہی مزہ آیا اتنی گرمی اور حبس کے بعد فریج کی ہوا نے ہمیں اندر تک ٹھنڈا یخ کر دیا۔ اتنے میں فریج کا دروازہ کھلا اور ایک بچے نے جو اندر جھانک کر دیکھا تو خوشی سے چلایا۔ اتنے مزے مزے کے پیلے پیلے آم، اس نے مجھے ہاتھوں میں اٹھایا اور بولا \" امّی میں یہ آم کھا لوں\"۔ امّی نے کہا سب اکٹھے کھائیں گے تو زیادہ مزہ آئے گا۔ جاؤ اپنے ابّو اور بہن بھائیوں کو بلا لاؤ۔ بچے نے مجھے واپس رکھا اورچلاتے ہوئے دوڑا۔ \"ابّو آجائیں مزے مزے کے میٹھے میٹھے رسیلے آم کھا لیں\"۔ اس کی یہ آواز سنتے ہی سب بچے دوڑے چلے آئے اور اکٹھے بیٹھ گئے۔ بچوں کے ابّو بھی آگئے تو امّی نے ہمیں نکالا اور ان کے سامنے سجا دیا۔ ہم سب آم بہت خوش تھے کہ آخر وہ دن آ گیا جس کے لۓ ہمیں بنایا گیا تھا۔ اب سب خوشی خوشی مزے لے کر ہمیں کھائیں گے۔ آموں میں میرا قد سب سے چھوٹا تھا، تو گھر کے سب سے چھوٹے بچے نے مجھے چنا۔ اور یہی تو میں چاہتا تھا۔ پھر وہی ہوا کہ اس نے مجھے خوب نرم اور پلپلا کروا کرچوسنا شروع کیا۔ میرے رس کے قطرے منہ میں جاتے ہی وہ کھلکھلا اٹھا اور اپنی ۓ طوتلی زبان میں بولا \" میلا آم شب شے اچھا ہے\"۔ میری گٹھلی باربار اس کے ہاتھ سے پھسل جاتی۔ آخر اس نے مجھے اپنے ہاتھوں اور منہ پر مل لیا، اور زبان نکال نکال کر ہونٹوں کے ارد گرد پھیرنا شروع کردی۔ ساری فیملی اسے دیکھ کر خوب ہنسی اور امّی نے جلدی سے میرے ساتھ اس کی تصویر کھینچ لی۔\r\nاور یوں میں ہمیشہ ہمیشہ کے لئے ایک میٹھی سے خوشی بن گیا۔ وہ لمحہ میرے لئے سب سے خوبصورت تھا جس پر میں نے خدا کا بہت شکر ادا کیا', '07m 14s', '0', '4', 'audio/ZHltI6ClYx7iGPKTHjMJXPxjDBINsOpTtKBdC45z.mp4', '', 'images/o8wwmEHkgreqeOeVEzQNOugM3B1LbWgJjvKUUpe0.png', '3', 'thumbnails/N4UPhJbCZjwLd5bAhhj64mBvJDwNpYHmAdcaDHf0.png', '2024-08-27 07:43:27', '2024-10-15 06:08:59'),
(41, 'ایک شکاری شیر', 'آؤ بچو سنیں کہانی ۔ ” ایک شکاری شیر کی کہانی”\r\nایک گاؤں کے پاس جنگل میں ایک بڑا ہی خطرناک شیر رہتا تھا۔ گاؤں کے لوگ اس سے بہت تنگ تھے، کیوں کہ وہ آۓ دن حملہ کرکے ان کے مویشی شکار کر لیتا۔ پہلے پہل تو وہ صرف رات کو حملہ کرتا، لیکن جب اس نے دیکھا کہ کوئی اسے روکنے والا نہیں تو اس نے دن دیہاڑے بھی حملہ شروع کردیا۔ گاؤں والوں کو یہ خوف تھا کہ دن کے وقت تو ہمارے بچے بھی گھروں سے باہر ہوتے ہیں تو شیر کہیں انہیں نقصان نہ پہنچا دے۔ سب بہت پریشان تھے کہ اس خوفناک شیر سے کیسے جان چھڑائیں۔\r\n\r\nایک دفعہ شیر جب دن کے وقت حملہ کرنے آیا تو سارے لوگ اپنے کام چھوڑ کر گھروں کو بھاگ گئے، پھر وہی ہوا جس کا ڈر تھا، گاؤں کا ایک چھوٹا سا بچہ جو کھیل میں مگن تھا شیر کے سامنے آگیا۔ شیر آہستہ آہستہ بچے کو گھورتا ہوا اس کی جانب بڑھا۔ جیسے ہی اس نے بچے پر حملے کا ارادہ کیا، گاؤں کے ایک بہادر لڑکے نے اس کا راستہ روک لیا۔ شیر کو یہ دیکھ کربہت غصہ آیا اور وہ زور سے دھاڑا تا کہ لڑکا ڈر کر بھاگ جاۓ۔ مگر اس لڑکے نے ہمت دکھائی اور اپنی جگہ پر ڈٹا رہا۔ شیر نے جب یہ دیکھا تو چھوٹے بچے کو چھوڑ کر اس لڑکے پر حملے کے لئے بڑھا، اس سے پہلے کہ شیر اس کے پاس پہنچتا، وہ لڑکا دوڑ کر قریب کے ایک درخت پر چڑھ گیا۔ اب شیر ڈھاڑتا چنگھاڑتا درخت کے گرد چکر لگانے لگا، کیونکہ وہ درخت پر تو چڑھ ہی نہیں سکتا۔ اتنے میں گاؤں کے ایک اور لڑکے نے ہمت کی اور بچے کو اٹھا کر جلدی سے اس کے گھر پہنچا دیا۔اور شیرکو للکار کر اپنی طرف بلایا۔ شیر تو پہلے ہی غصے سے بھرا تھا، فوراً اس دوسرے لڑکے پر حملہ کرنے تیزی سے دوڑا۔ لیکن یہ لڑکا بھی ایک درخت پر چڑھ گیا۔ شیر غصے سے لال پیلا ہو گیا۔ اب جب وہ دوسرے لڑکے کی طرف گیا، تو پہلا والا چھلانگ لگا کر درخت سے نیچے آگیا۔ اور شیر کو اپنی طرف بلانے لگا۔ اب جو شیر اس کی طرف واپس پلٹا تو وہ پھر سے درخت پر چڑھ گیا۔ اور شیر اپنا سا منہ لے کر رہ گیا۔ بس پھر کیا تھا دونوں لڑکوں نے شیر سے کھیلنا شروع کر دیا۔ وہ کبھی ایک کی طرف دوڑتا تو کبھی دوسرے کی طرف۔ آخر کار وہ تھک ہار کر جنگل کی طرف واپس پلٹ گیا۔ یہ پہلا موقع تھا کہ وہ شکار کئے بغیر ہی ناکام لوٹا۔ سارے گاؤں والے جو اپنے گھروں سے چھپ کر یہ منظر دیکھ رہے تھے، باہر آگئے اور دونوں بہادرلڑکوں کو کندھوں پر اٹھا کر خوشی سے ناچنے لگے۔\r\nاس دن کے بعد سے شیر نے رات کو حملہ شروع کر دیا۔ کبھی کسی کی بکری، کبھی دنبہ اور کبھی گاۓ کے بچھڑے اٹھا کر لے جاتا۔ سب گاؤں والے پھر سے پریشان ہو گئے کہ اب کیا کریں۔ انہی دونوں بہادر لڑکوں میں سے پہلے والے لڑکے نے سب گاؤں والوں سے کہا،\" دیکھو شیر اتنا طاقتور ہے کہ ہم لڑائی میں اس کا مقابلہ نہیں کر سکتے، لیکن ہمارے پاس عقل ہے جس کے ذریع بڑے سے بڑے طاقتور کو قابو کیا جا سکتا ہے۔ اگر آپ سب لوگ میرا ساتھ دیں تو ہم مل کر اس شیر سے چھٹکارا پا سکتے ہیں\"۔ سب گاؤں والوں نے یک زبان ہو کر کہا \"ہم تمہارے ساتھ ہیں، بس ہمیں اس خوفناک شیر سے نجات دلا دو\"۔ اگلے دن وہ لڑکا گاؤں کے کچھ طاقتور جوانوں کے ساتھ قریب کے پہاڑ پر گیا اور سب مل کے وہاں سے ایک بڑا سا پتھر اٹھا لاۓ۔ لڑکے نے باقی گاؤں والوں کے ذمہ بھی جوکام لگاۓ تھے وہ انہوں شام سے پہلے ہی مکمل کر لیۓ اور سب گھروں میں بیٹھ کر شیر کے آنے کا انتظار کرنے لگے۔\r\nرات ہو گئی اور شیر نے پھر سے گاؤں کا رخ کیا۔ سامنے ہی اسے کھونٹی سے بندھی ایک بکری نظر آئی اور اس کے منہ میں پانی بھر آیا۔ وہ تیزی سے بکری کی جانب بڑھا۔ لیکن جیسے ہی بکری کے قریب پہنچا اسے لگا جیسے اس کے پیروں کے نیچے سے زمین نکل گئی ہے اور وہ نیچے کو پھسلتا جا رہا ہے۔\r\nجی ہاں بچو! گاؤں والوں نے بکری کے ارد گرد گڑھا کھود رکھا تھا اوراسے گھاس پھوس سے ڈھک دیا تھا۔ شیر جب بکری کی طرف تیزی سے بڑھا تو ڈھڑام سے اس گڑھے میں گر گیا۔ اس سے پہلے کہ شیر سنبھلتا اور گڑھے سے نکلنے کی کوشش کرتا، قریب ہی چھپے گاؤں کے طاقتور لڑکوں نے پہاڑ کے اس بڑے پتھر کو دھکیل کر گڑھے کے اوپر رکھ دیا۔ شیر بہت چیخا دھاڑا لیکن اب اس کے لۓ باہر نکلنا ممکن نہیں تھا۔\r\nصبح سویرے چڑیا گھر کے لوگ آئے اور شیر کو لوہے کے پنجرے میں ڈال کر ساتھ لے گئے۔ سب لوگوں نے اس لڑکے کو شکاری شیر کا شکار کرنے پراپنے گاؤں کا سردار بنا لیا اور خوش وخرم زندگی بسر کرنے لگے۔', '06m 12s', '0', '2', 'audio/sJTTvdLlOC0EVThiWvnwRBzHghsPdkjq1MviJRDJ.mp4', '', 'images/UAhVnUnFzQQnyidu8P3na1hT9PX0tJNFiWIOjqwA.png', '3', 'thumbnails/eB624FleztXoFxaldVIFB8Kl69nDOzbDm5TFm42J.png', '2024-08-27 07:45:37', '2024-10-15 07:39:13'),
(42, 'پرینک والا لڑکا', 'ایک پہاڑی علاقے میں ایک بہت ہی شریر لڑکا رہتا تھا،۔ وہ روز صبح سویرے اپنی بھیڑوں کو چرانے نکل جاتا اور شام گئے گھر واپس آتا۔ اسے لوگوں کو پرینک کرنے کا بہت شوق تھا۔\r\n\r\nایک دن اس کے دل میں خیال آیا کہ کیوں نہ آج لوگوں کے ساتھ کوئی شرارت کی جائے۔ شام کو جب وہ اپنے گاؤں پہنچا تو اس نے کیا کیا؛ کہ زور زور سے چلانے لگا۔ “بچاؤ بچاؤ، گاؤں والو مجھے بچاؤ، شیر آیا شیر آیا ۔ یہ مجھے کھا لے گا”۔\r\n\r\nاس لڑکے کے چیخنے، چلانے کی آوازیں سن کر سب گاؤں والے اس کی مدد کو دوڑے۔ کسی کے ہاتھ میں ڈنڈا تو کسی کے ہاتھ میں بندوق، جسے کچھ نہ ملا وہ باورچی خانہ سے چھری اٹھا لایا۔ سب تیزی سے لڑکے کے پاس پہنچے تو دیکھا کہ وہ ایک پتھر پر چین سے بیٹھا گنّا چبا رہا ہے۔ لوگوں نے پوچھا \"کہاں ہے شیر\"، لڑکے نے جواب دیا \" آنے میں بہت دیر کر دی آپ سب نے\" ۔ بھلا شیر کے پاس اتنا وقت کہاں کہ وہ بیٹھا آپ کا انتظار کرتا رہے- جناب آئیں تو وہ ان کے ڈر سے بھاگ جائے۔\r\n\r\nلوگوں نے کہا \"ادھر ادھر کی مت ہانکو؛ اصل بات بتاؤ\"۔ لڑکا زور سے ہنسا اور بولا \" تو اصل بات یہ ہے کہ جب کافی دیر تک آپ لوگ نہیں آئے تو میں نے شیر سے گزارش کی کہ \"جناب آپ کل تشریف لے آئیے گا۔ آج گاؤں کے لوگ شاید کچھ مصروف ہیں اس لئے آنے میں کچھ دیر ہو گئی۔ اور شیر شرافت سے واپس چلا گیا\"۔\r\n\r\nگاؤں کے سادہ لوگوں کو لڑکے کوئی بات سمجھ نہیں آئی، انہوں نے سوچا کہ شیر خود ہی چلا گیا ہوگا؛ اب یہ لڑکا صرف باتیں بنا رہا ہے۔ خیر سب نے شکرادا کیا کہ کوئی نقصان نہیں ہوا اور واپس اپنے گھروں کو چلے گئے۔ لوگوں کو پرینک کر کے اس لڑکے کو بڑا مزہ آیا اور وہ دل ہی دل میں ہنسنے لگا۔ خود کو بہت ذہین اورعقلمند سمجھنےلگا۔\r\n\r\nاگلے دن کام سے واپسی پر اس نے پھر سے لوگوں کو پرینک کرنے کے لئے زور زور سے چیخنا شروع کر دیا۔ بچاؤ بچاؤ، گاؤں والو مجھے بچاؤ، شیر آیا شیر آیا ۔ یہ مجھے کھا لے گا۔ گاؤں والے پہلے سے دگنی رفتار میں دوڑے کہ آج تو ہم شیر کو نہیں چھوڑیں گے۔ لیکن جب وہاں پہنچے تو دیکھا کہ کوئی شیر ویر نہیں ہے اور وہ لڑکا کھڑا زور زور سے قہقہے لگا رہا ہے \" کیسا پرینک کیا تم لوگوں کو ہاہاہاہاہا \" وہ لڑکا ہنس ہنس کے دہرا ہو گیا اور گاؤں والوں کا خوب مذاق اڑایا۔ سب گاؤں والوں کو اس کی حرکت پر بہت غصّہ آیا اور اسے برا بھلا کہتے واپس اپنے گھروں کو چلے گئے۔\r\n\r\nپیارے بچو! پھرکچھ دن بعد ایسا ہوا کہ وہاں پہ سچی مچی شیر آ گیا۔ اب تو خوف کے مارے اس لڑکے کی ٹانگیں کانپنے لگیں۔ خیراس نے اپنی جان بچانے کے لئے زور لگایا اور اونچی آواز میں چیخنے لگا۔ \"بچاؤ بچاؤ، گاؤں والو مجھے بچاؤ، شیر آیا شیر آیا ۔ یہ مجھے کھا لے گا\"۔ گاؤں والوں نے اس کی ایک نہ سنی، سب یہی سمجھے کہ آج پھر یہ ہمیں پرینک کر رہا ہو گا۔ اورلاکھ چیخنے اور مدد کے لئے پکارنے کے باوجود کوئی اس لڑکے کی مدد کو نہ آیا۔\r\n\r\nدیکھا بچو! اسی لئے کہتے ہیں کہ جھوٹ بولنا بری بات ہے، پھر کوئی آپ کی سچی بات پربھی یقین نہیں کرتا۔', '04m 43s', '0', '4', 'audio/3A34HkCpKfw9f9zxuK1xIOyky79zUTMGEHXnAtBz.mp3', '', 'images/Tx1mMbHlgkTzKKw737UzvGHT3MCO5CiMzBf5FO1H.jpg', '3', 'thumbnails/uP69cjPizldHQOQcWPpJYmwY1T0BsuULCb9mPxbx.png', '2024-08-27 07:50:00', '2024-10-17 12:37:11'),
(43, 'روشنی کا کارنامہ', '“آؤ بچو سنیں کہانی  “روشنی کے کارنامے کی کہانی\r\nروشنی کا ایک نئے اسکول میں داخلہ ہوا اور آج اس کا سکول میں پہلا دن تھا۔ جب وہ کلاس میں داخل ہوئی تو کلاس ٹیچر نے بہت پیار سے اسے خوش آمدید کیا اور بیٹھنے کو کہا۔ اب اس کی نظر کلاس میں دوڑی تو سب بچیاں اسے دیکھ رہی تھیں۔ وہ کچھ شرما سی گئی اور تھوڑا جھجکی، کیونکہ کلاس میں آگے بیٹھنے کے لئے کوئی نشست خالی نہیں تھی۔ اتنے میں اس کی نظر سب سے پیچھے ایک خالی ڈیسک پر پڑی۔ روشنی اپنا بستہ اٹھائے وہاں پہنچی اور ساتھ والی نشست پر بیٹھی ہوئی لڑکی سے پوچھا ” میں اس خالی سیٹ پر آپ کے ساتھ بیٹھ جاؤں”؟ اس لڑکی نے بڑے روکھے سے لہجے میں جواب دیا ” تمہاری مرضی، بیٹھنا ہے تو بیٹھ جاؤ”۔\r\n\r\nجیسے ہی روشنی سیٹ پر بیٹھی اس لڑکی نے قریب ہو کر روشنی کے کان میں سرگوشی کی \" ویسے تم جلد ہی یہاں سے بھاگ جاؤ گی\"۔ جب وہ لڑکی روشنی کے قریب ہوئی تو اسے ایک ناگوار سی بو محسوس ہوئی اور اس نے پریشان ہو کر لڑکی کی طرف دیکھا، وہ عجیب سے انداز میں مسکرا رہی تھی اور اس کے پیلے پیلے دانت اور بھی عجیب لگ رہے تھے۔ روشنی کو احساس ہوا کہ یہ سمیل تو اس لڑکی کے منہ سے آ رہی ہے، شاید کئی دنوں سے اس نے برش نہیں کیا تھا۔ اتنے میں کلاس ٹیچر نے روشنی کو سب سے متعارف کروایا اور کلاس شرو‏ع ہو گئی۔\r\n\r\nبریک کے دوران وہ اکیلے بیٹھی لنچ کر رہی تھی کہ اتنے میں دو لڑکیاں اس کے پاس آئیں اور اپنا تعارف کروایا۔ ایک نے کہا میرا نام آمنہ ہے، دوسری بولی میں علیشہ ہوں۔ یہ تینوں بیٹھ کے لنچ کرنے لگیں اور ساتھ میں گپ شپ بھی شروع ہو گئی۔ علیشہ نے روشنی سے پوچھا \" تمہیں ہمارا سکول کیسا لگا؟ روشنی نے جواب دیا \"باقی تو سب ٹھیک ہے لیکن وہ لڑکی جو میرے ساتھ بیٹھی ہے کچھ عجیب سی ہے\"۔ آمنہ نے جھٹ سے کہا \" ہاں پوری کلاس میں کوئی بھی اس کے ساتھ بیٹھنا پسند نہیں کرتا\" روشنی نے پوچھا وہ کیوں؟ علیشہ نے جھجکتے ہوئے بتایا کہ اس کے منہ سے بہت سمیل آتی ہے اس لئے اس کے قریب جانا یا اس سے بات کرنا کسی کو پسند نہیں۔\r\n\r\nروشنی سوچ میں پڑ گئی اور چھٹی کے بعد گھر جا کر بے چینی سے ابّو کا انتظار کرنے لگی۔ شام کو جب ابّو آفس سے آئے تو روشنی کا اترا ہوا چہرہ دیکھ کربولے \" ہاں بھئ نئے سکول میں کیسا دن گزرا میری چڑیا کا، مزہ آیا، نئی دوستیں بنیں؟\" بس پھر کیا تھا روشنی نے تفصیل سے ساری بات ابّو کو بتا دی اور کہا کہ \" کل آپ چلیں میرے ساتھ سکول اور میری سیٹ تبدیل کروا دیں، میں اس لڑکی کے ساتھ نہیں بیٹھ سکتی۔\" ابّو نے کچھ سوچا اور کہا \"ابھی میں تھکا ہوا آیا ہوں؛ رات کو کھانے کے بعد اس پہ بات کرتے ہیں۔\r\n\r\nرات کو کھانے کے بعد ابّو نے روشنی کو بلایا اور کہنے لگے \" بیٹا روشنی زندگی میں ہمیں ایسے بھی لوگ ملتے ہیں جن کے ساتھ رہنا مشکل ہوتا ہے، بعض اوقات ان کی عادات ہمیں پسند نہیں آتیں، لیکن بہادر وہی ہوتا ہے جو ان کو برداشت کرتے ہوئے ان میں بہتری لانے کی کوشش کرتا ہے، اگر ایسے لوگوں کو ان کے حال پر چھوڑ دیا جائے تو وہ سب کے لئے مزید مشکلات پیدا کرتے ہیں۔ میرے لئے کوئی مشکل نہیں، میں کل ہی تمہاری سیٹ چینج کروا سکتا ہوں۔ اب یہ تم پر ہے کہ تم اس مسئلہ کا صبر وتحمل کے ساتھ مقابلہ کر کے اس کا حل تلاش کرو یا دوسرے بچوں کی طرح اپنی سیٹ تبدیل کرلو۔ بس اس بات کا خیال رکھنا کہ یہاں تو میں تمہیں اس مشکل سے نکال لوں گا، لیکن شاید زندگی میں کوئی ایسا بھی مقام آئے جہاں میں تمہاری مدد نہ کرسکوں، پھر تمہیں بہت زیادہ مشکل ہو گی۔ تو سوچ سمجھ کر فیصلہ کرو میں تمہارے ساتھ ہوں۔\r\n\r\nروشنی یہ تمام گفتگو بہت غور سے سن رہی تھی اور وہ سمجھ گئی کہ اس کے ابّو اسے ایک بہادر اورجرات مند انسان دیکھنا چاہتے ہیں۔ روشنی نے اسی وقت یہ فیصلہ کر لیا کہ وہ نہ صرف اس معاملہ کا مقابلہ کرے گی بلکہ اس کا کوئی نہ کوئی حل بھی تلاش کرنے کی کوشش کرے گی۔ یہ سوچتے ہوئے اسکا دل مطمئن ہو گیا اور وہ آرام سے سو گئی۔\r\n\r\nاگلے دن سکول میں وہ لڑکی یہ دیکھ کر حیران رہ گئی کہ روشنی پھر اس کے برابر میں بیٹھ گئی ہے۔ شاید وہ یہ سوچ رہی تھی کہ وہ بھی دوسری بچیوں کی طرح اگلے ہی روز اپنی سیٹ تبدیل کروا لے گی۔ روشنی نے مسکرا کر اسے سلام کیا اور سارا دن اس لڑکی کو یہ محسوس نہیں ہونے دیا کہ اس کے منہ سے آنے والی ناگوار سمیل کو برداشت کرنا کتنا مشکل ہے۔ خیر خدا خدا کرکے دن گزرا اور روشنی یہ سوچتی رہی کہ اس مسئلہ کو کیسے حل کیا جائے۔\r\n\r\nپہلے اس نے سوچا کہ کل اس کو صاف صاف کہہ دوں گی؛ کہ بھئی برش کرکے آیا کرو، سب لوگ تم سے دور رہتے ہیں کیونکہ تمہارے منہ سے سمیل آتی ہے، لیکن پھراسے خیال آیا کہ یہ سب تو اسے لوگ پہلے بھی کہہ چکے ہونگے؛ پھر بھی اس نے اپنی عادت نہیں بدلی۔ پھر اس نے سوچا کہ کیوں نہ اس لڑکی کو آرل ہائيجین کے حوالے گائیڈ کروں؛ کہ ہماری صحت کے لئے منہ کا صاف ہونا کتنا ضروری ہے؛ کیونکہ ہم جو بھی کھاتے ہیں اگر منہ صاف نہ ہو تووہ غذا ہمارے لئے نقصان دہ ہوتی ہے اور ہمیں بیمار کرتی ہے۔ اس خیال کو بھی روشنی نے یہ سوچتے ہوئے جھٹک دیا کہ یہ سب تو ہر کسی کو پہلے ہی پتہ ہوتا ہے، ماں باپ، استاد اور جب ڈاکٹر کے پاس جاؤ تو وہ سب سے پہلے یہی سب کچھ بتاتے ہیں۔\r\n\r\nیاخدا!!! پھر کیا کروں؛ روشنی کے دل میں خیال آیا کہ چھوڑو بس اس جھنجٹ کو کل سے سیٹ تبدیل کرو اور مزے سے اپنی لائف کو انجوائے کرو مجھے کیا پڑی۔ ایسے میں روشنی کے ابّو وہاں سے گزرے اور روشنی کو گہری سوچ میں ڈوبا دیکھ کر مسکراتے ہوئے چلے گئے۔\r\n\r\nاگلے دو روز وہ لڑکی سکول سے غیر حاضر رہی اور روشنی نے چین سے وقت گزارا۔ تیسرے دن جب وہ لڑکی سوجے منہ کے ساتھ سکول آئی تو ٹیچر کے پوچھنے پر پتہ چلا کہ اس کےمسوڑوں میں انفیکشن ہو گیا ہے۔ پھر وہی ہوا؛ ٹیچر نے آرل ہائيجین پر ایک لمبا لیکچر دیا؛ جس کا بظاہر اس لڑکی پر کوئی اثر نہیں ہوا۔ اب روشنی نے سوچا کہ \" یہ تو واقعی بہت سنجیدہ مسئلہ ہے اس کا کوئی نہ کوئی حل تو نکالنا ہی پڑے گا۔ چلو آج بھائی سے پوچھتی ہوں شاید وہ کوئی اچھا مشورہ دے دیں\"۔\r\n\r\nشام کو ساری بات تفصیل سے بھائی کو بتائی تو انہوں نے کہا \"یہ تو کوئی مسئلہ ہی نہیں، دو دن میں حل ہو جائے گا\"۔ بھائی نے جب آئیڈیا بتایا تو روشنی نے برا سا منہ بنا کر کہا \" ہائے نہیں نہیں، یہ میں نہیں کر سکتی؛ دوسرے کیا کہیں گے۔ میں ہرگز یہ نہیں کروں گی\"۔ بھائی نے لاپرواہی سے جواب دیا \" میرے ذہن میں تو یہی طریقہ آ رہا ہے ، باقی تمہاری مرضی\"۔\r\n\r\nمرتے کیا نہ کرتے، بھا ئی کی تجویز پر عمل کرنا ہی پڑا۔ اگلے دو دن بہت عجیب سی حالت میں گزرے؛ خود سے کراہت محسوس ہو رہی تھی۔ خیر بڑی مشکل سے ویک اینڈ گزرا اور پیر کی صبح روشنی سکول کے لئے تیار ہوئی تو امّی پہ پیار آگیا اب جو انہیں گلے لگایا تو انہوں نے روشنی کو پیچھے دھکیل دیا اور ناک پر ہاتھ رکھ کرغصّہ سے بولیں \" منہ تو دھو کے آؤ \"۔ مجھے بہت شرمندگی ہوئی، پیچھے دیکھا تو بھائی اور ابّو دونوں ہنس رہے تھے۔ روشنی کو شدید غصّہ آیا۔ اس نے سوچا \" بہت ہو گئی بس، بھاڑ میں گیا سارا پلان، ابھی کینسل کرتی ہوں سب کچھ۔ ۔ لیکن پھر اسے خیال آیا کہ جہاں اتنا صبر کیا ہے تو کچھ دیر اور سہی۔\r\n\r\nروشنی سکول پہنچ کر جلدی سے اپنی سیٹ پر بیٹھ گئی؛ اب جو وہ لڑکی آئی تو روشنی نے گہرا سانس لیا اور اس کے قریب ہو کر منہ کھول کر پورا سانس اس پہ چھوڑتے ہوئے بولی \" کیا حال ہے، کیسی ہو\"۔ اس لڑکی نے فورا ناک پہ ہاتھ رکھا اور روشنی کو عجیب عجیب نظروں سے گھورنے۔ روشنی کو برا تو لگا مگر اس نے بڑی لاپرواہی سے اس سے باتیں شروع کر دیں۔ بس پھر کیا تھا جتنا وہ لڑکی پیچھے ہٹتی روشنی اتنا ہی اس کے قریب ہو کر ہنس ہنس کے باتیں کرتی۔ ساری کلاس حیران تھی کہ یہ کیا ہو رہا ہے۔\r\n\r\nپورا دن وہ لڑکی آگے آگے اور روشنی اس کے پیچھے پیچھے؛ آخر تنگ آ کر اس لڑکی نے کہا \" تم میرا پیچھا کیوں نہیں چھوڑ دیتیں۔ روشنی نے کہا \" ایسے نہیں پہلے وعدہ کرو آج سے روزانہ دانت برش کیا کرو گی، ورنہ میں بھی برش چھوڑ دوں گی اور ایسے ہی تمہارے پیچھے پڑی رہوں گی۔ آج وہ لڑکی خود اسی تکلیف سے گزری جو وہ دوسروں کو دیتی تھی، اسے شدید ندامت ہوئی اور اس نے روشنی سے کہا کہ واقعی اپنے منہ کی سمیل کسی کو نہیں آتی؛ لیکن دوسروں کے منہ سے سمیل آرہی ہو تو وہ ناقابل برداشت ہوتی ہے۔\r\n\r\nدراصل بھائی نے روشنی کو یہ مشورہ دیا تھا کہ تم بھی دو دن برش کیئے بغیر سکول جاؤ پھر اس لڑکی کو احساس ہو گا، اور واقعی ایسا ہی ہوا۔ اس دن کے بعد وہ لڑکی، پھر کبھی برش کیئے بغیر سکول نہیں آئی اور وہ دونوں پکی دوست بن گئیں۔\r\nاس کامیابی پر روشنی کو بہت خوشی ہوئی، ابّو اور بھائی نے بھی اس کی خوب تعریف کی؛ جس سے روشنی کے اعتماد میں بہت اضافہ ہوا۔ اور وہ سمجھ گئی کہ ہماری چھوٹی سی کوشش، دوسروں کی زندگی میں کیسے بہتری لا سکتی ہے۔', '11m 39s', '0', '8', 'audio/P6DpYQSz5Nkiis6MTtuHFJPPIshyGPA66SViusPA.mp3', '', 'images/KguhAYpdRDIK2Apdg3WUu2u8lywCEyv8TU7IKHa8.jpg', '10', 'thumbnails/aMKk65zocg8KNtlUvVj3plU3DB1QRfUN5Xim8MeG.png', '2024-08-27 07:52:15', '2024-10-15 15:47:44'),
(44, 'طوطا، مینا اور مالی', 'آؤ بچو سنیں کہانی “طوطا، مینا اور مالی کی کہانی”\r\nپھلوں کے ایک باغ میں بہت سے پرندے رہتے تھے۔ صبح صبح جب وہ اپنی بولیاں بولتے تو ان کی سریلی آوازیں کانوں کو بہت بھلی لگتیں۔ باغ کے مالی کو پرندوں سے بہت پیار تھا اور وہ انہیں پھل کھانے سے کبھی نہ روکتا۔\r\nاسی باغ میں ایک طوطا اور مینا بھی رہتے تھے۔ دونوں دن بھر مزے مزے کے پھل کھاتے اور رات کو آرام سے سوجاتے۔\r\n\r\nلیکن طوطے کی ایک بری عادت تھی؛ وہ کھاتا کم اور ضائع زیادہ کرتا۔ جبکہ مینا ایک پھل جب تک پورا ختم نہ کرلے دوسرے کی طرف نہ جاتی۔ طوطا زیادہ تر پھل کتر کتر کر ضائع کرتا اور ادھورا چھوڑ کے کبھی ایک کو چونچ مارتا اور کبھی دوسرے کو۔ باغ کے مالی کو طوطے پر بہت غصّہ آتا کہ اس کی وجہ سے کتنے پھل ضائع ہو جاتے ہیں۔\r\nمینا جب بھی مالی کو پریشان دیکھتی تو طوطے کو سمجھاتی؛ کہ ہم اس باغ میں رہتے ہیں، کھاتے ہیں، پیتے ہیں، آزادی سے گھومتے ہیں؛ ہمیں اس کو نقصان نہیں پہنچانا چاہئیے، کہیں ایسا نہ ہو کہ باغ کا مالک ہمیں یہاں سے نکال دے؛ پھر کہاں جائیں گے ہم۔ مینا کے لاکھ سمجھانے پر بھی طوطا اپنی حرکت سے باز نہ آیا اور پھلوں کو کترتا رہا، خراب کرتا رہا۔\r\n\r\nایک دن باغ کا مالک اپنے کارندوں کے ساتھ درختوں سے پھل اتارنے آیا؛ تو وہ یہ دکھ کر بہت ناراض ہوا کہ زیادہ تر پھلوں پہ پرندوں کی چونچ کے نشان ہیں اور وہ بازار میں بکنے کے قابل نہیں۔ اس نے مالی کو بہت ڈانٹا اور حکم دیا کہ جلد از جلد ان نقصان دہ پرندوں کا بندوبست کرے۔\r\n\r\nمالی کو چونکہ پرندوں سے بہت پیار تھا اور وہ نہیں چاہتا تھا کہ ایک طوطے کی غلطی کی سزا سب پرندوں کو ملے۔ اس لئے اس نے فیصلہ کیا کہ طوطے کو پکڑ کر قید کر لیا جائے۔ اگلے دن صبح سویرے جب طوطا اپنے گھر سے نکلا تو مالی پہلے سے درخت پر موجود تھا۔ طوطے نے گھبرا کر جیسے ہی اڑنا چاہا مالی نے جھپٹ کر اس پہ ایک چھوٹا سا جال ڈال دیا اور طوطا اس میں پھنس گیا۔ اس نے بہت زور زور سے ٹیں ٹیں شروع کردی۔ مینا بھی اس کے شور سے باہر آگئی اور طوطے کو قید میں دیکھ بہت دکھی ہوئی۔ مگر وہ کیا کرتی ایک نہ ایک دن تو یہ ہونا ہی تھا۔\r\n\r\nطوطا شور مچاتا رہا مگر مالی نے اس کی کوئی پرواہ نہ کی، اور اسے لاکر ایک پنجرے میں قید کردیا۔ مالی نے طوطے کو سبق سکھانے کے لئے پورا دن اسے بھوکا رکھا اور شام کو ایک تازہ پھل اس کے پنجرے میں ڈال دیا۔ طوطے کو شدید بھوک لگی تھی وہ قید کا غم بھول کے جھٹ پٹ سارا پھل کھا گیا۔ وہ جو دن میں دسیوں پھلوں کو کترتا تھا اس نے ایک ذرّہ بھی ضائع نہ کیا اور سب کا سب کھا گیا۔ اب روز کا یہی معمول تھا؛ مالی دن بھر طوطے کو بھوکا رکھتا اور شام کو جو پھل اسے دیتا وہ اس کا ایک ذرّہ بھی نہ چھوڑتا۔\r\n\r\nکچھ دن بعد باغ کا مالک پھر سے اپنے کارندوں کے ساتھ آیا؛ اب جو اس نے دیکھا کہ سارے پھل صحیح سالم ہیں تو بہت خوش ہوا۔ مالی کی بہت تعریف کی اور اسے انعام بھی دیا۔\r\n\r\nاب مالی نے طوطے کو صبح شام دو وقت پھل دینا شروع کر دیا اور طوطا جی بھر کے کھاتا اور ایک دانہ بھی ضائع نہ کرتا۔ دن بھر جب وہ دوسرے پرندوں کو آزادی سے ادھر ادھر اڑتا پھرتا دیکھتا تو اپنی نادانی پر بہت افسوس کرتا۔ مینا بھی روز اسے دیکھنے آتی اور دل ہی دل میں اس کے لئے دعا کرتی؛ کاش طوطا اپنی غلطی سے سبق سیکھ لے اور پھر سے آزاد ہو جائے۔\r\n\r\nایک دن مالی نے صبح سویرے ڈھیر سارے پھل طوطے کے پنجرے میں ڈال دئیے۔ طوطا یہ دیکھ کر بہت حیران ہوا کہ میرے لئے تو دن بھر کے دو پھل ہی کافی ہیں؛ مالی نے یہ ڈھیر سارے پھل کیوں ڈال دئیے۔ اس نے روز کی طرح صرف دو پھل کھائے اور باقیوں کو چھوا تک نہیں۔ اگلے دن جب مالی نے یہ دیکھا تو وہ سمجھ گیا کہ طوطے کو سبق مل گیا ہے؛ اس لئے اب وہ باغ کے پھل خراب نہیں کرے گا۔\r\n\r\nمالی پنجرے کے قریب آیا اور اس نے پنجرے کا دروازہ کھول دیا۔ طوطا پہلے کچھ حیران ہوا، پھر پنجرے سے نکلا اور جھٹ سے اڑ کر قریب کے ایک درخت پر بیٹھ گیا۔ مینا بھی وہاں موجود تھی دونوں بہت خوش ہوئے۔ لیکن طوطے کو یقین ہی نہیں آرہا تھا کہ وہ پھر سے آزاد ہو گیا ہے۔\r\n\r\nمینا نے طوطے کو سمجھایا کہ مالی نے تمہارا امتحان لینے کے لئے ڈھیر سارے پھل تمہارے پنجرے میں ڈالے، لیکن تم نے اتنا ہی کھایا جتنی تمہاری ضرورت تھی۔ اس لئے اس نے تمہیں آزاد کر دیا؛ کہ اب تمہیں نعمت کی قدر ہو گئی ہے اور تم دوبارہ کبھی پھلوں کو کترکتر کے خراب نہیں کرو گے۔\r\n\r\nطوطا سمجھ گیا۔ دونوں نے نظروں ہی نظروں میں مالی کا شکریہ ادا کیا اور خوشی خوشی اڑ کر اپنے گھرچلے گئے۔ واقعی طوطے کو سبق مل گیا تھا اور اس نے دوبارہ کبھی پھلوں کو خراب نہیں کیا۔\r\n\r\nپیارے بچو! ہمیں بھی اللہ کی نعمتوں کی قدر کرنی چاہئیے اورانہیں ضائع نہیں کرنا چاہئیے', '07m 08s', '0', '6', 'audio/hj9Ks8etpfSiKCBRIjB46eXi7TWbHwqXODik81lt.mp3', 'videos/N71fZYspOFRWNCBmS9LeflyoeqM4QAcQpWDqGXNK.mp4', 'images/zO0lSrcB3LGOAAF1OrU3EsWePywkMCqZxym4OajO.jpg', '10', 'thumbnails/XBgywVMlhLHKxdyza3WtAKFS44WGtAx7mnMmSCGn.png', '2024-08-27 07:55:35', '2024-10-15 06:10:06'),
(50, 'شیخ چلّی کی مزاحیہ کہانی', 'آؤ بچو سنیں کہانی \"شیخ چلّی کی مزاحیہ کہانی\" \r\nکسی گاؤں میں ایک شخص رہتا تھا جس کا نام چلّی تھا، وہ ہر وقت شیخی بھگارتا اور جہاں کہیں لوگوں کو اکٹھے دیکھتا وہ ان کے پاس جا کر بیٹھ جاتا اور دوسروں کو گفتگو کا موقع دئیے بغیر بولتا چلا جاتا اور اپنے جھوٹے سچے کارنامے بیان کرتا۔ لوگ اس کی اس عادت سے بہت تنگ تھے اور ہر وقت شیخی بھگارنے کی وجہ سے اسے \" شیخ چلّی\" کہہ کر پکارتے۔ \r\n\r\nآہستہ آہستہ لوگ اس سے کنّی کترانے لگے۔ وہ جہاں بھی جاتا تو سب ایک ایک کرکے وہاں سے اٹھ جاتے اور آخر میں شیخ چلّی اکیلا رہ جاتا۔  اب تو لوگ اسے دور سے دیکھ کر ہی پتلی گلی نکل جاتے۔ پھر بیچارے دکانداروں کی شامت آجاتی اور شیخ چلّی کسی نہ کسی کی دکان پہ بیٹھ جاتا اور لمبی لمبی ڈینگیں مارتا۔ دکاندار بیچارے دکان چھوڑ کر کہاں جاتے۔ گاہک بھی جہاں شیخ چلّی کو بیٹھا دیکھتے تو وہاں جانے سے کتراتے اور دوسری دکان سے سودا  لے لیتے۔\r\n\r\nآخر کار دکاندار اس کی منت سماجت کر کے مختلف بہانوں سے اسے گھر بھیج دیتے، مگر وہ کچھ دیر بعد دوبارہ آ دھمکتا۔ سارے تاجر اس سے بہت پریشان تھے۔ کوئی اگر باتوں باتوں میں ڈانٹ دیتا تو شیخ چلّی ہر گز برا نا مناتا بلکہ پھر زیادہ سے زیادہ وقت وہیں گزارتا اور اس بیچارے دکاندار کا چلتا کاروبار ٹھپ ہو جاتا۔\r\n\r\nہر روز صبح صبح  شیخ چلّی جب بازار کا رخ کرتا تو ہر تاجر دم سادھ لیتا؛ کہیں آج اس کی شامت تو نہیں آنے والی؛ ایسا لگتا جیسے سب نے کوئی بدروح دیکھ لی ہو۔ سب دل میں دعائیں کرتے \" جلّ تو جلال تو، آئی بلا کو ٹال تو\"۔ اور پھر بیچارے کسی ایک کی شامت آجاتی اور وہ سارا دن جلتا کڑھتا اپنی قسمت کو کوستا رہتا۔\r\n\r\nایک دن سب دکاندار اکٹھے ہو کر گاؤں کے ایک سیانے بزرگ کے پاس گئے اور انہیں اپنی مشکل بتائی۔ سیانے بزرگ نے کچھ دیر مسئلے پر غور کیا اوردکانداروں سے پوچھا  \"کیا تم میں سے کوئی ایسا بھی ہے جس کی دکان پر شیخ چلّی کبھی نہ آیا ہو\"۔ ان میں سے ایک نے کہا \"جی وہ خوش قسمت انسان میں ہوں۔ بازار میں سب سے پہلی دکان میری ہے مگر وہ کبھی بھی میری دکان پہ نہیں آتا\"۔ سب نے اسے گھور کر دیکھا اور بولے اچھا ہم سب پھنسے ہوئے ہیں اور تم اکیلے مزے کر رہے ہو۔ ہم کل ہی بتاتے ہیں شیخ چلّی کو کہ وہ آپ کی دکان کو بھی رونق بخشیں۔ وہ زور سے چیخا \"نہیں نہیں بھائی خدا کے لئے یہ غضب نہ کرنا\"۔ سب اس کی حالت دیکھ کر ہنسنے لگے۔ سیانے بزرگ نے کہا \"اچھا کل میں خود آؤں گا اور دیکھوں گا کہ آخر یہ ماجرا کیا ہے\"۔ \r\n\r\nاگلے دن وہ صبح سویرے بازار پہنچ گئے اور چھپ کر انتظار کرنے لگے، اتنے میں انہیں دور سے شیخ چلّی آتا دکھائی دیا۔ سب دکانداروں کی سانسیں اوپر کی اوپر اور نیچے کی نیچی رہ گئیں۔ سیانے بزرگ نے دیکھا کہ شیخ چلّی بازار کی پہلی دکان سے گزتے ہوئے کچھ جھجکا اور کافی فاصلہ رکھتے ہوئے وہاں سے تیزی سے گزر گیا۔ اور آگے ایک دکان میں داخل ہو گیا۔ سیانے بزرگ نے سوچا کہ پہلی دکان میں ضرور کوئی نہ کوئی ایسی چیز ہے جس سے شیخ چلّی ڈرتا ہے۔ \r\n\r\nاب جو انہوں نے جاکے پہلی دکان کا معائنہ کیا تو سمجھ گئے کہ آخر کیوں شیخ چلّی کبھی بھی اس دکان میں داخل نہیں ہوتا۔  وہ مسکرائے اور دکانداروں سے بولے \"سب شام کو آجانا تمہارے مسئلے کا حل مل گیا ہے۔\" شام کو سب اکٹھے ہوئے تو سیانے بزرگ نے انہیں مسئلے کا آسان حل بتا دیا۔ وہ بہت حیران ہوئے کہ اتنی سامنے کی بات وہ کیوں  سمجھ نہ پائے۔ خیر انہوں نے سیانے بزرگ کے مشورہ کے مطابق انتظام مکمل کیا اور بے چینی سے صبح  کا انتظار کرنے لگے۔\r\n\r\nاگلے دن جیسے ہی شیخ چلّی بازار کے قریب پہنچا ایک چھوٹے سے کتے نے اس کا استقبال کیا اور زور زور سے بھئو بھئو کرنے لگا۔ کتا حالانکہ بندھا ہوا تھا مگر اس کی بھئو بھئو سے ہی شیخ چلّی کا دم نکل گیا اس  نے آؤ دیکھا نہ تاؤ  تیزی سے پلٹا اور گھر کی طرف دوڑ لگا دی۔ \r\n\r\nدراصل سیانے بزرگ نے دیکھا تھا کہ پہلی دکان کے باہر ایک آوراہ کتا سو رہا ہے؛ جس سے بچے بھی نہیں ڈرتے؛ اور ہلکی سی ہش کرو تو وہ دور بھاگ جاتا ہے؛ مگر شیخ چلّی اس کے ڈر سے کبھی بھی پہلی دکان پہ نہ جاتا۔ اس لئے وہ سمجھ گئے کہ اگر شیخ چلی کو صرف بھونکنے والے کتے سے ڈرایا جائے تو دکانداروں کی جان چھوٹ سکتی ہے۔ اور ایسا ہی ہوا۔ \r\n  \r\n اس دن کے بعد شیخ چلی نے دوبارہ کبھی بازار کا رخ نہ کیا! اور سب دکانداروں نے سکھ کا سانس لیا۔', '7m 5sec', '0', '4', 'audio/cwLvIawNq9yHhmMu6gSfO9qhmu6X2bVtX9lHVn0O.mp4', 'videos/KHFpd7dFU010D7roLmt3kpdmxvh6hwzaT4bnm4LF.mp4', 'images/BSjaiSJgT5fW5WMx1kPs5KVJxx6qpHY77NPCw286.png', '7', 'thumbnails/dMuENYQpDoHD4HdmETi988cj2LHf9mYe4Xd4MuRL.png', '2024-10-11 18:13:24', '2024-10-1